INSERT INTO `event_log` (`id`, `created_date_time`, `last_modified_date_time`, `fk_user_id`, `level`, `title`, `content`) VALUES
(1, '2016-06-21 21:29:56', '2016-06-21 21:29:56', 5, 'INFO', 'Generelt', 'Emilie har styrt både lunsj og kveldsmaten selv i dag. Det har gått bra. Hun driver fortsatt å gjemmer unna mat til tider. Men det skaper ingen konflikter. Stort sett går det bra og hun er blid og fornøyd'),
(2, '2016-06-22 06:29:26', '2016-06-22 06:29:26', 5, 'CONFLICT', 'Lunsj på skolen', 'Emilie ble krakilsk da hun ikke fikk spise lunsj på skolen. Hylte, skrek og stanget hode i veggen. Kalte meg slem og løp ut døren. Hun syklet opp til skolen.\r\n\r\nAndreas slo seg også vrang i dag tidlig når han oppdaget at emilie hadde lånt hettegenseren hans. Jeg ble sur fordi han reagerte slik, noe som førte til at han bannet og slang mange stygge ord til meg.\r\nBa meg hoppe ut av vinduet, gå å henge meg, viste meg fingeren. Dette vil få konsekvenser, må tenke litt på hvilke.\r\nHan for ikke spille på pc eller mobil i en uke,  tenker jeg. Samt gi meg en unskylding. '),
(3, '2016-06-22 07:29:06', '2016-06-22 07:29:06', 5, 'INFO', 'Frokost', 'Emilie har puttet mye av forkostblandingen i jakkelommen. Gir henne ekstra fresubin til lunsj'),
(4, '2016-06-23 04:54:05', '2016-06-23 04:54:05', 5, 'INFO', 'Frokost konflikt', 'Gårsdagens konflikt løst seg etterhvert og øvige måltider gikk knirkefritt. Generelt skal det lite til for at en konflikt trigges. Men den er relativt lett å løse ved å inngå kompromier eller ved å la henne få viljen sin. Hun takler ikke brå endringer eller hvis ting ikke blir akkurat slik som hun har tenkt det. Uansett, det viktigste er å få henne til å spise nok mat. Og noen ganger må man da la henne få viljen sin for å unngå konflikter.\r\n'),
(5, '2016-06-25 06:32:07', '2016-06-25 06:32:07', 5, 'INFO', 'God progresjon', 'Emilie veide inn på 44,4 på ullevål i går.\r\nHun har også vokst 1 cm og er nå 159cm høy.\r\nGenerelt sett går det nå bra og hun visere tydelige tegn til at sulten begynner å styre mat mengen. Særlig til kveldsmaten. Da spiser hun ofte ett par ekstra brødskiver og ett ekstra glass melk.\r\nHumøret hennes er stort sett bra og hun er ikke lenger så nærtagen. Videre er hun heller ikke innesluttet så lenge av gangen.'),
(6, '2016-06-25 20:10:41', '2016-06-25 20:10:41', 5, 'INFO', 'Måltider', 'Emilie har styrt mange av måltidene i dag.\r\nHun sier at alt går bra og at hun spiser det hun skal. Men det er grunn til å tro at hun lager måltidene etter sitt ønske og følger ikke alle reglene vi har. Som for eksempel smør på brødskivene. Hun har heller ikke sluttet med å lure unna mat. Konklusjonen er at alle måltidene må fortsatt følges opp og kontrolleres nøye.'),
(7, '2016-06-25 20:57:24', '2016-06-25 20:57:24', 5, 'CONFLICT', 'Kveldsmat', 'Hun nekter å spise brødskivene fordi det er smør på dem. Sier også at hun ikke vil mer opp i vekt. Dette fordi hun nå har begynt å vokse igjen og skjønner da ikke hvorfor hun må ytterlig opp i vekt. Hun skirker og smeller med dørene, tramper i trappa.\r\nJeg sliter også med å beholde roen, sinnet tar overhånd og jeg kastet brødskivene i fanget hennes. Hun sier at hun ikke vil leve mer. Ting roet seg ganske rask og så gikk hun å la seg. Kveldsmaten var ikke ihht. diet planen.'),
(8, '2016-06-26 08:04:07', '2016-06-26 08:04:07', 5, 'INFO', 'Frokost konflikt', 'Hun har store problemer med å spise frokostblandingen. Klager på at det er alt for mye. Men mengden har ikke blitt endret.\r\nEr veldig frustrert og gråter og snakker høyt at hun ikke klarer å spise så mye. Roer seg litt ned etter vel 10 min og setter seg ned for å spise. Plukker ut litt frokostblanding ut av skålen og legger det på bordet. \r\nJeg lar henne bare holde på. Tenker at det er bedre at hun spiser litt enn ingenting. Jeg har ingen virkemiddel når hun blir slik. Må bare å få henne til å spise og håpe på at hun roer seg. Hun er veldig urolig, mye opp og ned mens hun spiser. Klarer ikke å sitte i ro. '),
(9, '2016-06-26 08:04:49', '2016-06-26 08:04:49', 5, 'INFO', 'Generelt', 'Emilie har styrt både lunsj og kveldsmaten selv i dag. Det har gått bra. Hun driver fortsatt å gjemmer unna mat til tider. Men det skaper ingen konflikter. Stort sett går det bra og hun er blid og fornøyd'),
(11, '2016-06-28 16:13:04', '2016-06-28 16:13:04', 5, 'INFO', 'Emilie', 'Hun er blitt mye flinkere til å ta kontakt med vennene sine og de lager avtale om å finne på noe sammen.\r\nDenne uken har hun vært mye ute å lekt med vennene sine. Hun har da også fått lov til å kjøpe seg lunsj på egenhånd.\r\nNoe hun setter vedlig stor pris på. jeg lar henne gjøre det fordi jeg ser at det er som balsam for psyken og humøret hennes.\r\nHun føler seg da ikke annerledes en de andre. '),
(13, '2016-06-29 15:49:20', '2016-07-03 09:00:13', 5, 'CONFLICT', 'Konflikt Middag', 'Her ble det problemer rundt valg av middag.  Emilie ringt og sa hun ønsket fiskesuppe til middag. Når hun kommer hjem viser det seg at jeg har lagd feil fiskesuppe. Jeg sier at hun kan spise denne og her starter konflikten. Det blir mye frem og tilbake. Hun vil ut å kjøpe noe annet, noe jeg ikke godtar. Ber henne om å smake på fiskesuppen først. Noe hun ikke vil. Hun prøver gjentatte ganger å gå ut, så jeg låser døren og tar nøklene. Hun er ganskw så fortivelt og snakker/skriker til meg. Jeg klarer å holde en rolig tone. Hun begynner å bli hysterisk og sparker og prøver å velte kjøleskapet. Jeg tar da grep og legger henne på gulver pg holder henne fast. Hun hyler, sparker og prøver å bite neg. Jeg sier ingenting men holder henne bare stabilt og prøver mitt beste for at det ikke skal være vondt. Etter vel 3 minutter dør anfallet ut og hun slapper av. Jeg slipper taket og bare sitter og styker henne på ryggen. Vil ligger slik i mange minutter. Ting løser seg så, jeg går ut å kjøper den fiskesuppen hun liker. Spør meg selv i ettertid hvorfor jeg ikke gjorde det med en gang. Men det handler om å ha kontrollen og hun skal ikke styre måltidene.'),
(14, '2016-06-30 16:15:02', '2016-06-30 19:22:01', 5, 'INFO', 'Middag', 'Gjemte unna pasta under middagen. Legger pasta''en faktisk under puten på stolen, som ikke er vedlig vanskelig for meg å oppdage. Hun bryr seg ikke så mye om jeg oppdager det eller ei.\r\nDette fordi hun trodde jeg hadde hatt oliven olje i vannet under koking av pasta''en. Noe jeg faktisk hadde glemt denne gangen. Ellers spiste hun opp alt. Dette utløste ingen konflikt.'),
(15, '2016-07-02 16:22:09', '2016-07-02 16:22:09', 5, 'CONFLICT', 'Konflikt i forbindelse med Frokost', 'Det ble problemer når jeg sa at hun måtte ha sukker på havregrøten. Noe som har gått greit tidligere, men som i det siste viser seg å være problematisk for henne. Hun truer med å slå seg vrang. Løste det ved å la henne bestemme mengde sukker. Men slik skal det ikke være. Hun utnytter nå det st jeg ønsker å unngå konflikt og prøver å finne løsninger. Vi mister da de faste rammene rundt måltidene. Og hun prøver hele tiden å ta kontroll over måltidene. Hun foreslår hele tiden nye varianter og det er krevende å påse at kalori inntaket da blir ihht. diet planen.'),
(16, '2016-07-03 08:49:14', '2016-07-03 09:15:28', 5, 'INFO', 'Frokost', 'I dag sov hun til kl. 1000. Hun er ikke sulten, men ønsket å lage seg wraps med laks til. Noe jeg godtar. Jeg spør hvor mye laks hun har hatt i wrapsen. Hun sier 3 skiver, men når jeg sjekker viser det seg at hun har brukt skinke og ikke laks. Hun luver bevist. Og det er nytt. Vi er nå inne i en litt vanskelig periode hva måltider angår. Humøret hennes svinger. Venter litt an og ser om hun vil ha frokost litt senere. Hun pleier å bli sulten og be om mat. Hun er nå frustrert men vil har ingen konflikt akkurat nå. Det løste seg ved st jeg fikk henne til å drikke 325 ml fresubin. Ting har hele tiden gått rolig for seg.'),
(17, '2016-07-03 09:09:00', '2016-07-03 09:22:20', 5, 'INFO', 'Ferie', 'Det er vanskelig å bestemme seg for ferie grunnet emilie. Måltidene er blitt mer utfordrende fordi hun hele tiden prøver å ta styringen, samt hun kommer med nye forslag til mat hele tiden. Når vi er uenige i hva måltidet skal bestå av, nekter hun å spise og prøver å gå ut. Her må det mye overtale til for å gå henne til å ta til seg noe næring.  For ting skal løse seg er det helt essensielt at jeg beholder roen og gir henne litt tid. Det å vise masse omsørg og kjærlighet for henne er også meget viktig når hun har sine tunge øyeblikk. Hun sier at de oppstår uten forvarsel og at hun er vet heller ikke hvorfor eller hva som er grunnen til sine tunge perioder. Hin sier at det er generelt litt vanskelig hele tiden. '),
(18, '2016-07-04 17:03:48', '2016-07-04 20:30:51', 5, 'CONFLICT', 'Problemer', 'Dette har så langt vært en meget tung dag. Det startet etter frokost da jeg kjeftet på emilie fordi hun gjorde knebøy på rommet sitt. Noe hun benekter selv om jeg så henne. Hun blir sur på meg fordi jeg kjefter på henne. Frem til lunsj er vi ikke sammen. Hun ordner og spiser lunsj selv. Det går bra. Middagen lager jeg og det starter bra. Men så slår hun seg vrang å begynner å grise med maten ved å mose den mellom fingerene sine. Det har hun aldri gjort før. Hun er sont på meg og snakker høyt. Sier hun vil bort fra familien og aldri se meg igjen. Sier også at mamma ikke bryr seg en dritt om henne. Hun er forsåvidt rolig nå, men snufser og gråter. Jeg skal prøve å snakke med henne nå. Problemene dabbet sake og sikkert ut mens vi snakket sammen. Blant annen kom det fram at hun synrs jeg aldri sier takk når hun hjelper meg. Hun blir veldog oppskakket og frustrert når jeg kjefter eller blir sint på henne. Her ligger også mye av grunnen til at hun blir lei seg. Når er alt tilbake til det normale igjen.'),
(19, '2016-07-04 20:33:10', '2016-07-04 20:33:10', 5, 'INFO', 'E og A', 'Det siste gangene vi alle har spilt fotball har ikke e og a kranglet. De fungere mye bedre sammwn nå. Slik som de alltid har gjort og det er sabla godt å se. Humøret er tilbake hos dem begge og de fjoller og ler mer nå.'),
(20, '2016-07-04 20:35:13', '2016-07-04 20:35:13', 5, 'CONFLICT', 'Konflikt i forbindelse med Middag', 'Ble litt trøbbel, men det løste seg. Se notat tidligere i dag.'),
(21, '2016-07-05 20:51:49', '2016-07-05 20:51:49', 5, 'INFO', 'Ferie', 'Dro til gjendesheim i dag. Andreas jar sprudlet og fjollet i hele dag. E og A har nå en veldig fin tone og leker fint sammen. Det er flott å se. '),
(22, '2016-07-08 19:47:25', '2016-07-08 20:18:50', 5, 'INFO', 'Ferie oppsummering', 'Selv om vi er på ferie ligger e sin diet som en klam hånd over oss. Det er ikke lett å få en pause fra sykdommen. Måltidene blir mye vanskliger å følge opp når man er på ferie. E prøver hele tiden å rive seg løs fra de faste rammene og vil helst styre alt rundt måltidene selv. Hun lesere også hva alle produktene inneholder av næringsstoffer. Hun nekter å spise hvis hun ikke får det akkurat slik hun ønsker.\r\nSelv om vi har forholdsvis mye aktivitet så roer hun seg ikke ned. Hun står fortsatt mye og setter seg sjeldent ned. Ei har hun spist mer på trass av økt aktivitet. \r\n I morgen når vi kommer hjem skal jeg sjekke vekten. Vil tro den har gått ned.\r\nEllers har disse fire dagene stort sett gått greit. E og A har lekt fint sammen.\r\n'),
(23, '2016-07-09 15:12:03', '2016-07-09 15:16:35', 5, 'CONFLICT', 'Spiste ikke Frokost', 'På fredag 8.7 spiste ikke e frokost. Ville ha knekkebrød men det godtok ikke jeg. Hun drakk 125 ml fresubin. I ettertid er e enig i at det var riktig å nekte henne knekkebrød og si at hun da må bare drikke fresubin. Hun sier sykdommen styrer henne slik st hun da ikke klarer å ta noe annet. Det spesielle denne gangen var at hun ikke spiste noen ting, men jeg må sette grenser, ellers vil alt skli ut. E er enig i at hun ikke må få lov til å hele tiden velge nye ting som ikke står på diet planen. \r\nAlt foregikk rolig.'),
(24, '2016-07-10 08:24:59', '2016-07-10 08:24:59', 5, 'INFO', 'Vekt tap', 'E har gått med 700 g i løpet av de 4 dagene vi var på ferie og veier nå 44.1 kg. Det var ikke helt uventet. Vi er blitt enige om å øke med 25 ml fresibin inntil vi har tatt inn vekttapet. Hun virker motivert for det.\r\nMen slikt svinger hele tiden. Dette viser bare at det er utrolig viktig å ha faste forhold rundt måltidene. Noe vi ikke klarte under ferien. Hun spiste heller ikke mellom måltid de dagene. Samt at fredag 8.7 var det problemer rundt alle måltidene. \r\nVi reiste mye rundt og det er selvfølgelig heller ikke optimalt. Det å være på en fast plass under ferien er nok mye bedre.'),
(25, '2016-07-10 22:05:00', '2016-07-10 22:05:00', 5, 'INFO', 'Måltidene', 'E er nå tilbake til de faste rammene rundt måltidene og hun spiser nå som normalt igjen. Matlysten er tilbake og jeg håper hun henter inn vekttapet raskt. Hun drikker mer melk enn det som er satt opp på diet planen, særlig til kveldsmaten. Ofte spiser hun også litt ekstra. Hun synes også det er lettere å holde seg til planen når hun er hjemme. Hun må hente inn vekttapet før vi eventuelt reiser bort igjen. Og hvis så skjer skal vi da være på samme stedet hele tiden.\r\n'),
(26, '2016-07-11 16:03:49', '2016-07-11 16:03:49', 5, 'INFO', 'Kastet brødskiver', 'Emilie gjemte unna 2 brødskiver under frokosten i dag. Vi ble enige om at neste gang den lysten meldte seg skal hun prøve å si ifra til meg på forhånd.  '),
(27, '2016-07-11 16:14:23', '2016-07-11 16:14:23', 5, 'INFO', 'Oppsummering ferie', 'Det er ikke slik at man legger sykdommen igjen hjemme når man drar på ferie. Den følger henne 24 timer i døgnet enn hvor hun er hen. Hun trenger fortsatt faste rammer å forholde seg til ellers prøver hun titt og ofte å snike seg unna både dessert, frukt og mellom måltider. Selv om jeg aktiviserer henne mer enn normalt blir hun ikke roligere. Hun setter seg ikke automatisk ned av den grunn. Hun blir neste bare mer rastløs. Sliten blir hun aldri. Mye aktivitet gjør at hun spiser mer til kveldsmat.\r\nUtfordringen er å holde faste rammer rundt måltidene, hvis ikke vil sykdommen lettere kunne ta over. Generelt vise emilie progresjon på de fleste områder, men jeg ser også at gamle ljente ting dukker opp igjen. Slik som at hun synrs nå det er problemer å ha sukker i grøten, samt å veie seg. \r\nVi har fortsatt en lang vei å gå.'),
(28, '2016-07-12 11:58:03', '2016-07-12 11:58:03', 5, 'INFO', 'Generelt', 'Hun er blitt litt mer viren hva dessert og mellom måltid angår. Må mase og følge henne nøye opp på dette. Ei liker hun å veie seg på tirsdager her hos neg. Hun er redd for å finne på noe tull hvis hun ser at vekten har gått opp. Her er det viktig å holde fast ved rutinene.'),
(29, '2016-07-12 12:05:24', '2016-07-12 12:05:24', 5, 'INFO', 'Lunsj', 'Man må følge nøye med under måltidene. Hun har fått en lei tendens til å lure unna mat. Til lunsj i dag skrapte hun bort smøret på brødskivene. Jeg bare smørte på nytt,  noe hun godtok.'),
(30, '2016-07-14 06:10:54', '2016-07-14 06:10:54', 5, 'INFO', 'Kontroll', 'Jeg lar nå emolie få lov til å velge og ta på pålegge på brødskivene selv. Dette da hun ikke lenger er opptatt av hvor mye pålegge det er på en brødskive. Hun tar på mye pålegg og gjene salat, paprika og agurk hvor det passer. Hun spiser nå også, leverpostei, hvitost, røklaks, peanuttsmør.\r\nJeg skjærer opp og tar på smør fortsatt.'),
(31, '2016-07-15 13:00:45', '2016-07-15 13:00:45', 5, 'CONFLICT', 'bytte undertøy', 'I dag tidlige ble det bråk fordi jeg ba henne om å bytte undertøy. Hun har nå gått i det samme undetøyet siden søndag. Jeg har mang en gang oppfordret henne til å skifte.\r\nHun rev ned tøykruven på rommet sitt, men etter litt hyl og skrik, byttet hun og så gikk hun ut for å treffe en veninne.'),
(32, '2016-07-15 13:04:36', '2016-07-15 14:35:46', 5, 'CONFLICT', 'bup møte', 'Hun kom hjem kl. 1400 og begynte på spise lunsj. Jeg oppdager at hun har skarpet bort smøret på rundstykket og så starter problemene.\r\nFørst vil hun bare ha fresubin, så vil hun ikke ha noe som helst. Møte på BUP vil hun heller ikke gå  i. Jeg  prøver å ro det hele ned og jobber fortsatt  med saken. Hun er meget opprørt men forholdsvis rolig. Hun er er lite responsiv på mine forslag og står apatisk og ser ut av vinduet. Jeg prøver derfor en ny vir og sier at hun kan prøve å løse opp i dette på egnehånd, det vil si spise opp lunsjen. Fortelelr henen at jeg går ut for å kjøpe fresubin og at hun bare kan ringe meg hvis det er noe. Hun er fortsatt like taus. Jeg drar og når jeg kommer tilbake etter vel 45 minutter står hun utenfor og leker litt med en fotball. Hun har da spist opp lunsjen på egenhånd og er tilbake i normal gange. Hun avtalt med mamme om å gå å spille minigolf. Så da løste floken seg releativt smertefritt for oss begge.'),
(34, '2016-07-15 21:24:11', '2016-07-15 21:24:11', 5, 'CONFLICT', 'Konflikt i forbindelse med Lunsj', 'Problemer med lunsj. Hun spiste opp alt til slutt.'),
(35, '2016-07-15 21:26:31', '2016-07-15 21:26:31', 5, 'INFO', 'Måltider', 'Hun ønsker at jeg skal passe bedre på under måltidene slik at hun ikke blir fristet til å gjemme unna mat. Det vil si at jeg må sitte sammen med henne under hele måltidet. Noe jeg ikke alltid gjør.'),
(36, '2016-07-16 06:57:10', '2016-07-16 06:57:10', 5, 'INFO', 'Lese bok', 'E har nå begynt å lese igjen og vise nå små tegn på at hun ønsker og vill slappe av mer.\r\nI går satt hun i sofaen og leste i vel 30 minutter.'),
(37, '2016-07-16 20:01:26', '2016-07-16 20:01:26', 5, 'INFO', 'Fresubin', 'I dag har det ikke blitt fresibin til lunsj og middag. Dette er ett bevist valg. Hun har spist bra.'),
(38, '2016-07-17 21:18:51', '2016-07-17 21:18:51', 5, 'INFO', 'Kveldsmat', 'Emilie spiste bra, og hadde pitabrød med biff og salat, samt melk og fresubin.\r\n'),
(39, '2016-07-18 12:46:58', '2016-07-18 12:46:58', 5, 'INFO', 'Frokost', 'Til frokost spiste Emilie pannekaker med bringebær,  som hun hadde laget selv av melk, mel og havregryn, dvs.ikke egg.  Hun drakk Fresubin, men ikke melk, da det var melk i pannekakene. Emilie forklarte at dette var ok, siden man også droppet melkeglass når hun spiste frokostblanding? Etter frokost gikk vi en liten tur...'),
(40, '2016-07-19 08:08:53', '2016-07-19 08:10:50', 5, 'INFO', 'Overnattet', 'E overnattet hos m fra søndag til mandag. Alt gikk greit. E benyttet forøvrig anledningen til å velg mat som ikke var på menyen til både kvelds og frokost. Dette er meget uheldig, men ikke uventet. Hun prøver hele tiden og ta kontrollen og styre måltidene slik hun selv ønsker det. Vi skal ikke tillate at så skjer. Vi skal hele tiden ha full kontroll.'),
(41, '2016-07-19 08:48:47', '2016-07-19 08:48:47', 5, 'CONFLICT', 'Konflikt i forbindelse med Frokost', 'Her ble det konflikt grunnet veiing. Hun liker når svært dårlig å veies og slår seg vrang. \r\nSer også at mange gamle tanker som jeg trodde hun var ferdig med dukker opp igjen. Som for eksempel tidspunket for måltidet.\r\nMen alt blir vanskelig når først ett problem har oppstått. Da bare baller det på seg og hun sier at alt er bare dritt. Men hun hyler og skriker mindre en tidligere og det er litt lettere å komme ut av konflikten. Jeg ser hele tiden etter løsninger, uten å måtte gi tapt for det viktigste, som er å få henne til å spise.'),
(42, '2016-07-21 07:47:46', '2016-07-25 08:54:50', 5, 'INFO', 'Treningsøkt', 'I dag tok jeg med Emilie på en løpetur fra maridalen skole og opp til Fagervann. Som er en ganske har løype på vel 3 km en vei.\r\nHun er i veldig bra form og henger lett med meg opp dit. Hun er nå flinkerer til å ta til seg næring etter en treningstur. Hun blir også meget sulten etter en slik hard økt.\r\nJeg tar henne med på slike økter for å vise henne at hun er mye sterkere nå en da hun var på sitt tynneste. Dette slik at hun skal bli mer fortrolig med å gå opp i vekt.\r\n '),
(43, '2016-07-29 08:32:00', '2016-07-29 08:38:29', 5, 'CONFLICT', 'Frokost', 'I dag fikk jeg en liten påminnelse om at Emilie fortsatt sliter med sykdommen hele tiden. Det har nå gått veldig bra over en lang periode og jeg har gradvis gitt henne mer og mer tilit hva måltider angår. Og må være meget påpasselig på at jeg ikke går fort fort frem. For hun sliter voldsomt, selv om hun ikke alltid gir utrykk for det.\r\nI dag ble det meget problematisk å spise frokost, hun oppfører seg ganske rolig så lang. Hun vil ikke snakke med meg og er bare på rommet sitt.\r\nJeg velger å se det hele an og håper på at hun roer seg ned.'),
(44, '2016-08-04 08:29:00', '2016-08-04 08:37:16', 5, 'INFO', 'Norway Cup', 'mandag, tirsdag og onsdag har Emilie spilt 4 kamper for Sagene under Norway Cup. Hvor hver kamp var 2x25 minutter.\r\nDet har gått greit selv om hun på onsdag ble vedlig skuffet over at de ikke gikk videre til 1/16 finalen. Hun har også vært flink til å ta til seg drikke. men her må jeg følge nøye opp, det går ikke helt av seg selv. Hun har også tatt en ekstra  flaske fresubin hver dag. Grunnet dette hadde vi en ekstra veiing i dag, for å sjekke vekten. Hun veide 44.7 kg, så vi har da klart å kompansere for den økte aktiviteten. Økt aktivitet ser også ut til å øke matlysten hennes, hun blir fort sulten og spiser bra om mer en hva som er satt opp på diet planen. Men forbrenningen henens er fortsatt utrolig høy og vi greier ikke å få til vektøkning. Hun har nå ligger på ca 44.6 kg i en månde.'),
(45, '2016-08-09 09:40:00', '2016-08-09 16:18:20', 5, 'INFO', 'Veiing', 'Emilie slo seg litt vrang da tidspunktet for kontroll på Ullevål sykehus ble flyttet fra 1030 til 1300 i dag. Dette grunnet at nytt tidspunkt kræsjer med lunsj,\r\nSå hun er sliter fortsatt litt med å være fleksibel. Hun dro ut for å leke med Sunniva, men kom tilbake kl. 1245 så vi rakk akkurat å stille til kontroll.\r\nDette var siste kontroll på Ullevål sykehus. Fra nå av skal vi kun forholde oss til BUP.'),
(46, '2016-06-17 16:54:00', '2016-08-09 16:56:20', 5, 'INFO', 'pepilie', 'Emilie kjøpt godtepose og spiste litt av den. Sier at hun fortsatt tenker mye på å ikke sitte. Sliter med å kunne slappe av. Vil ikke overnatte hos mamma fordi hun er redd for at det blir for mange fristelser under kveldsmaten og frokosten.'),
(47, '2016-06-08 16:56:00', '2016-08-09 16:57:24', 5, 'INFO', 'pepilie', 'Emilie forteller at hun har veldig lyst til å få ett naturlig forhold til trening, samt å kunne legge seg ned å slappe av.'),
(48, '2016-06-07 16:57:00', '2016-08-09 16:58:38', 5, 'INFO', 'pepilie', ' Hun liker ikke å veie seg og prøver med å putte ting under genseren.\r\nHun prøver å øke vekten inn mot veiing ved å spise ekstra mye dagen før. Vekten har nå stagnert og det er meget vanskelig å få til en økning. Har bedt bup om å sende søknad til capio.\r\n'),
(49, '2016-06-04 16:58:00', '2016-08-09 17:00:50', 5, 'INFO', 'pepilie', 'Hun nektet å spise havregrøten fordi jeg hadde hatt sukker i. Hun tok da heller 350 ml fresubin. Hun har styrt lunsjen selv i dag. Emilie har vært sammen med Sunna i hele dag. Droppet fresubin til lunsj og middag. Spiste 2 ekstra brødskiver til lunsj. Har også spist litt smågodt. Ser ut som om sulten begynner å ta styringen i ny og ne.\r\n'),
(50, '2016-06-03 17:01:00', '2016-08-09 17:02:57', 5, 'CONFLICT', 'pepilie', 'Jeg ber Emilie om å veie seg. Noe hun nekter å gjøre. Går med på det etter hvert, men prrøver da å putte ting under genseren før hun veier seg.\r\nJeg ser selvfølgelig det og da stikker hun bare av. Hun sykler til skolen på trass av at jeg sier hun ikke får lov til det. Har ringt BUP for å søke råd. Jeg har ikke noe virkemiddel mot henne. Ser også at hun gjemmer unna mat, da særlig nøttenblandingen, som er ett mellommåltid. Hun går også veldig ofte på do etter å ha spist, mye hyppigere enn tidligere. Jeg ønsker nå at det søkes om plass på RASP. Hun nekter å følge mine regler og blir hysterisk.\r\n'),
(51, '2016-06-02 17:03:00', '2016-08-09 17:04:17', 5, 'CONFLICT', 'pepilie', 'kl. 2100 startet en konflikt fordi jeg sier hun må spise go morgen youghert til kveldsmat. Hun skriker, tramper i gulvet og smeller med dørene. Hun er hysterisk og gråter. Jeg sier at jeg ringer bvt hvis hun ikke roer seg. Hun roet seg ned etter vel 30 min. Tok 200 ml fresubin og en brødskive.\r\n'),
(52, '2016-05-11 17:04:00', '2016-08-09 17:05:32', 5, 'INFO', 'pepilie', 'Hun fortsetter med å gjemme unna mat, finner stadig på nye metoder. Men er lett å oppdage, samt å få henne til å spise det eller øke fresubin for å kompansere.\r\n'),
(53, '2016-05-04 17:05:00', '2016-08-09 17:06:30', 5, 'INFO', 'pepilie', 'Emilie har de siste 2 ukene begynt å gjemme unna mat. Hun prøver ikke å skjule det og ting løsere seg bra som regel etter at jeg snakker med henne. Forholdet til mat og der å gå ytterlig opp i vekt er fortsatt problematisk for henne. Men hun er nå mer bevist og kjemper bra i mot sin indre demoner. Lar henne få trene og sykkle til skolen mot at hun tar ekstre fresubin eller tilsvarende. Dette har meget god effekt på humøret hennes. Har også innført ett mellommåltid (nøtter eller energibar),  kl. 1500, som hun ofte styrer selv. Og det går nå nesten knirkefritt. Må bare minne henne på det. Hun kan nå også ta initativ til å spise mer til enkelte måltidere. Særlig hvis hun har hatt en aktiv dag. Hun kjenner ofte sulten melde seg, men er forsatt veldig opptatt av mengede og antall kalorier. Liker he&#314;ler ikke å veie seg lenger. Hun øker vel ca 200 g i uken og kanskje dette er en passe økning slik at hun rekker i venne seg til kroppen endringer og akseptere dem.\r\nJeg snakker masse med henne om alt rundt sykdommen og påpeker viktigheten av ett naturlig forhold til mat og egen kropp.\r\nHun har uttykt missnøye med kroppen sin.\r\nAlt i alt, så svinger det frem og tilbake, men stort sett går det greit og vi er på rett vei med fin progresjon.'),
(54, '2016-03-23 17:07:00', '2016-08-09 17:08:30', 5, 'INFO', 'pepilie', 'Emilie forteller meg at påsken 2015 fortalte Siri Birgitte at hun hadde problemer med å velge og spise mat.\r\nSiri Birgitte hadde da beroliget henne og sagt at det går over. Emilie sier at hun var veldig frustrert over dette og i ett svakt øyeblikk åpnet seg opp for Siri Birgitte.\r\nSiden har hun aldri nevnt dette til noen før hun nå sier dette til meg. Må rådeføre meg og revurdre Siri Birgitte sitt samvær med barna.\r\n'),
(55, '2016-01-09 18:09:00', '2016-08-09 17:11:26', 5, 'INFO', 'pepilie', 'Emilie akkutt innlagt på Ullevål Sykehus hvor det konstanteres at hun har anoreksia. Hun har lav puls, 40 pr. min, samt store mangler på vitaminer og mineraler. Antall hvite blodlegemer er også farlig lavt. Hun har også helvetesild. Hun er 158 cm og veier 35 kg. Situasjonen er kritisk og legen sier at det er fare for liv og helse. De kan heller ikke si om hun vil få varig meen.\r\n'),
(56, '2016-01-01 18:11:00', '2017-04-25 03:28:31', 5, 'INFO', 'pepilie', 'Emilie har gradvis over en lang periode redusert sin kropsvekt fra 45 til 39 kg.\r\nHun er en meget aktiv jente som har holdt på med fotball, dans, riding og bandy.\r\nSamt løping sammen med meg.\r\nPå ett tidspunkt begynte hun å bli opptatt av hva hun spiste. Og slik jeg husker det, startet det med å droppe smør på brødskivene. Og slik har det jevnt og trutt utviklet seg til ett unormalt forhold til hva som er sunn og usunn mat. Humøret hennes endret seg også gradvis til å bli veldig nærtagen og følsom for bemerkninger vedrørende hennes kosthold.\r\nHun ble fort sint og begynner lett å gråte.\r\nPå trass av hennes fokus på sunn mat og livsstil klarte jeg ikke se at hun hadde redusert matinntaket. Hun spiste fire måltider om dagen, pluss mellom måltider.\r\nHun tilberedte all mat selv og var svært nøye og brukte lang tid på både tilberedingen og spisingen. Hun spiste derimot mye. Ei har jeg noen gang registrert at hun kaster opp eller kvitter seg med maten på annen måte.\r\nEttersom tiden går blir hun veldig restiktiv hva gpdteri angår og spiste det kun på lørdager. Jeg registrerte også at hun nesten bare drikk vann.\r\nMedio juni 2016 oppsøkte vi fastlegen for kontroll. Dette fordi hun hadde gått ned ca. 6 kg og veide nå 39 kg og var 158 cm høy. Fastlegen tok blodprøver og viste ellers ingen tegn til bekymring hva vekt angår. Jeg ba om en henvisning til BUP.\r\nBlodprøven viste at alt var normalt med Emilie hva neringsinnholdet i blodprøven angår. Det bemerkes at hun har ett snev av allergi  mot kannin.\r\nJeg slår meg til ro med dette resultatet og tenker ikke så mye mer på dette. Høsten 2016 flytter Emilie og Andreas til sin mamma for å bo der en liten periode mens jeg pusser opp i Stavangergata. Ved Jule tider 2016 er jeg fredig og Emilie og Andreas kommer tilbake til meg. Emilie har da blitt vesentlig tynnere og jeg begynner å bli veldig bekymret.\r\n9. januar 2016 oppsøker jeg fastlegen igjen og hun blir veldig stresset grunnet Emilie sitt lave blodtrykk. Hun ber oss oppsøke Ullevål Sykehus umiddelbart. Noe vi selvfølgelig også gjorde. '),
(57, '2016-08-14 07:25:00', '2016-08-14 08:09:35', 5, 'INFO', 'Generelt', 'Generelt sett har Emilie blitt litt bedre på alle områder. Det være seg blant annet, valg av mat, takle uforutsette endringer, sitte/ligge å lese i bok, sitte å se på TV/Film sammen med med. Hun har nå mye lettere for å kunne slappe av og hun er stort sett alltid i godt humør. Hun er i ferd med å vende tilbake til sitt normale jeg.\r\nHun er også flin til å oppsøke og leke med venner. I sommer har hun lekt mye med både Åste og Sunniva, som er nye bekjentskaper fra klassen på Nordberg. \r\n\r\nJeg har også gradvis latt henne få lov til å styre måltidene selv. Noe som går ganske så bra. Men jeg må hele tiden sjekke hva hun spiser.\r\nGenerelt sett spiser hun store prosjoner og mye mat. men utfordingen er at hun stort sett velger mager mat og viker unna de produktene som inneholder mye fett.\r\nHun er flink til å spise og det er nå sulten som styrer tidspunkt for måltider og mengde. Hvis hun har mye aktivitet en dag så spiser hun også mer til måltidene.\r\nHun spiser nå nesten aldri mer youhurt til kveldsmat eller frokost. Hun er også begrenset når det kommer til desert. Hun velger da ofte å heller spiser mer middag.\r\nNoe som også gjennspelier seg når hun kontroll veies, dette da fettprosenten hennes holder seg stabilt lav. Hun øker fortsatt mer i muskelmasse  enn fett.\r\nDette har nok sammenhenge med henes valg av mat, samt tildels høy aktivitet. Forbrenningen hennes er uforandret, dvs. fortsatt meget høy. Så vi må følge med på at hun tar til seg nok næring.'),
(58, '2016-08-14 07:39:00', '2016-08-14 07:45:28', 5, 'INFO', 'Capio', 'Slik som situasjonen er nå, er det ikke behov for med bistand fra Capio.\r\njeg øsnker at hun skal start opp ppå skolen som normalt den 23.08.2016. En innleggelse på Capio vil også skape forstyrrelser rundt skolen.\r\nNår så er sagt, er helsen til Emilie mye viktigere en skolen oppstarten. \r\nJeg ønsker kun å dra på møte for å finne ut hva de tilbyr av hjelp og opplegget rundt dette.\r\nDette i tilfelle behovet dukker opp senere. Emilie er fortsatt syk og trenger masse oppfølging, tilbakeslag vil nok også komme.\r\nDerfor er det greit å få bedre innsikt i hva salgs hjelp man kan forvente å motta.'),
(59, '2016-08-14 07:45:00', '2016-08-14 08:10:15', 5, 'INFO', 'Skolestart', 'Når skolen  nå starer opp igjen 23.08.2016 skal Emilie få lov til å styre lunsj selv. \r\nJeg begynner å jobbe 100% igjen fra og med 23.08.2016. Så for vi se hvordan dette går.\r\nJeg vil fortsette med å veie henne her hjemme hver tirsdag morgen.'),
(60, '2016-08-14 07:48:00', '2016-08-14 07:54:42', 5, 'INFO', 'Fotball', 'Emilie skal få lov til å starte opp med fotball igjen. Vi tar  en uke av gangen og ser hvordan dette virker inn på vekten.\r\nVekten er fortsatt det jeg vil styre aktiviteten etter. Med andre ord, hun skal opp i vekt.'),
(61, '2016-08-14 08:10:00', '2016-08-14 08:16:52', 5, 'INFO', 'Samvær', 'Emilie må fortsatt være mest hos meg. Men hun kan nå får lov til å overnatte hos mamma etter eget ønske i ny og ne.\r\nHun kan nå også få lov til å spise alle måltidene hos mamma.\r\nEmilie har nå såpass god kontroll selv at jeg tror det er fint for henne å kunne være litt mer hos sin mamma.\r\nMen dog ikke mer en en dag av gangen. Dette inntil videre.\r\nMamma må fortsatt jobbe med å kunne styre og følge opp måltidene. Hun har en lei tendens til å høre på og følge alt Emilie sier og foreslår av mat valg.\r\nDette på trass av at menyen ligger her, samt mine oppfordringer til å ikke gjøre så.'),
(62, '2016-08-15 08:44:00', '2016-08-15 08:49:06', 5, 'INFO', 'ROS kurs', 'Jeg har nå besluttet å droppe Capio i denne omgang. \r\nØnsker å se det hele an frem til JUlen 2016, Hvis vi fortsatt sliter med vektøkning kan vi da heller søke om plass på RASP, som ligger i Oslo.\r\nHar derfor kansellert møte på Capio i morgen.\r\n\r\nHar meldt Emilie og meg på følgende kurs http://www.nettros.no/aktiviteter/veien-videre/ som jeg tror kan være nyttig for Emilie.\r\nHar også meldt Emilie og meg inn i ROS.'),
(63, '2016-08-16 08:33:00', '2016-08-16 08:47:13', 5, 'INFO', 'Veien videre', 'Opplegget for Emilie blir som følgende:\r\n<ul>\r\n<li>Vi følger fortsatt gjeldende diet plan</li>\r\n<li>Hun veies kun hjemme, en gang i uken, hver tirsdag morgen.</li> \r\n<li>Hun skal spise lunsj på skolen.</li>\r\n<li>Hun skal få sykle til skolen gitt at hun drikker en YT eller Fresubin når hun kommer frem (dette gjelder fra stvgt.)</li> \r\n<li>Skal begynne med individuell terapi på BUP</li>\r\n<li>KOS kurs veien vidrere 14 og 15 september 2016</li>\r\n<li>Hun skal få være med på fotballkamper og en trening i uken for Sagene. Hun må selvfølgelig kompansere for dette ved å ta til seg ekstra næring.</li>\r\n</ul>\r\nProgresjonen vil evalueres fortløpende av meg og BUP. Vektøkning er fortsatt den viktigste parametern vi styrer etter. Samt at hun fortsetter å vokse.\r\nAlle måltider må fortsatt følges nøye opp og påse at hun spiser ihht. gjeldende diet plan.\r\nVed nyttår vil det så gjøres en ny vurdering om det er behov for utvidet hjelp, i form av RASP, CAPIO, eller tilsvarende.\r\nJeg har forøvrig stor tro på at Emilie vil klare dette selv. Hun er på god vei. '),
(64, '2016-08-16 14:52:00', '2016-08-16 14:57:38', 5, 'CONFLICT', 'Sykkeltur', 'Vi har vært på en ganske lang sykkeltur i dag og badet på Frysja 33 etterpå. Emilie ville ikke ta til seg ekstra næring og nektet å dirkke en YT etterpå.\r\nEi har hun drukket Fresubin eller melk til lunsj, eller spist frukt. Noe som gjør meg ganske så forbannet, fant det derfor best at hun nå er hos Siri Birgitte fra nå av og frem til i morgen. Dette slik at jeg skal få en liten pause og unngå å kjefte for mye på henne. Vi må bare fortsette som vanlig igjen i morgen.'),
(65, '2016-08-16 15:22:00', '2016-08-16 15:23:55', 4, 'INFO', 'Sms til pappa', 'At det går ann og bli så sint for en så liten filleting som at jeg ikke drakk hele den Sjokkomelken!  Du skjønner, det er ikke alltid like lett for meg og det har ingenting å si om jeg har løpt en mil eller sittet på rævva hele dagen for plutselig så blir det vanskelig. Og du kan bare slutte og kalle meg sånne stygge ting for det har du ikke grunn til i det hele tatt! Bare fordi jeg glemte fresubinen så trenger du ikke og kalle meg dust! Selvom du kanskje ikke tenker over det så sårer det! Jeg skjønner at du er møkka lei, og du synes kanskje du har det så fælt fordi du ikke får jobbe og har ikke energi og at du kan bli gæren du og! Du har rett, og jeg hadde gjort hva som helst for og la deg og alle dere slippe og oppleve dette, du trenger ikke og snakke så mye om hvor lei du er, for jeg tenker på det hele tiden og det gjør meg vondt langt inn i hjerterota!  Ikke tro jeg ikke tenker på dere og hvor fælt dere og har hatt det! Men uansett hva du tror, så er det jeg som har det værst.. Selvom jeg ikke snakker om det like mye som deg!\r\n\r\nOg du må tenke før du åpner munnen for det er ikke alt det er like gøy og høre! Jeg gikk ikke fordi jeg hadde så lyst til og dra til mamma! Men jeg føler at du ikke vil ha meg hos deg, noe som tydeligvis stemte..'),
(66, '2016-08-16 21:41:00', '2016-08-16 21:51:13', 5, 'INFO', 'Gjemmer mat', 'Emilie holder fortsatt på med å gjemme unna mat i komoden sin. Fant nå ca 3-4 halve rundstykker som har blitt gjemt unna over en liten periode.\r\nHun gjøre nok dette for å prøve å holde vekten sin i sjakk. Hun har hatt marginal økining i sommer. Hun kontrollerer vekten sin ved valg av mager mat samt aktivitet.\r\nMye tyder på at jeg har gitt henne litt for mye ansvar og anledning til å styre måltidene selv. Samtidig er jeg ikke like streng lengre. Må nok gå ett skritt tilbake og ta tilbake kontrollen. Noe som nok vil skape flere konflikter. For hun har store problemer med å gi slipp på kontrollen over måltidene. det er eldig vanskelig å få henne til å spise noe som hun selv ikke har valgt. Hun skal hele tiden ha særbehandling og vil tilrede måltidene selv. jeg må også stramme inn på desert og frukt til. her har vi slurvet i det siste. Selv om fysikken hennes nå bare bilr bedre og bedre må vi  ikke glemme at hun fortsatt er syk og må ikke få for stor ansvar. da vil hun kjøre seg selv i senk igjen.'),
(67, '2016-08-16 08:10:00', '2016-08-17 08:13:35', 6, 'INFO', 'Kveldsmat', 'Emilie spiste 1 rundstykke, fiskeburger (stor) , 2 små yougerter og melk og fresubin , '),
(68, '2016-08-17 10:16:00', '2016-08-17 10:18:00', 5, 'INFO', 'Sms til emilie', 'Hei Emilie,\r\nVil bare fortelle deg at jeg har funnet all maten du har gjemt i komoden din.\r\nVi må også jobbe mye mer med ditt forhold å ta til seg riktig næring. Særlig etter en aktivitet. \r\nDu kan ikke gå rundt å tro at du gjør alt riktig nå, for det er ikke tilfelle. Du må slutte å telle kalorier og få ett bedre forhold til fet mat. Du går svært lite opp i vekt på trass av at du vokser. Og din fettprosent at fortsatt alt for lav. Så tro ikke at du nå er i mål. Jeg har gitt deg en sjanse til å unngå capio. Bruk den fornuftig. Jeg gidder ikke holde på slik. Ja, jeg blir sint når du holder på\r\n slik. Enten du liker det eller ei. Vær ærlig og snakk, slutt å lure unna, da blir jeg heller ikke sint.\r\nVil også du skal skrive ned dine tanker i nye og ne. Særlig etter at du har hatt det tungt. Gjerne skrive dagbok. \r\nVi må videre i prosessen. Tenk på det.\r\nDu må bare legge det bak deg å gå videre. Det er viktig. Vi kan ikke henge oss opp i probelmene. Men finne måter å løse dem på. Tenk positivt. Vi er på rett vei og mye har blitt bedre. Nedturene skal ikke få dominere. De rister vi av oss og bare fortsetter videre.\r\nSykdommen skal ikke få styre oss, vi skal styre den og bli kvitt den.'),
(69, '2016-08-18 08:17:00', '2016-08-18 23:20:54', 5, 'INFO', 'Dagbok', 'Har blitt enig med Emilie om at hun skal begynne å skrive dagbok. Ikke nødvendigvis hver dag, Men spesielt når hun har tunge dager. Jeg tror det er en fin ting for å bevistgjøre, samt få henne til å reflektere over utfordringene sine.'),
(70, '2016-08-18 23:21:00', '2016-08-18 23:24:46', 5, 'INFO', 'Aktivitet', 'Er som regel titt og ofte ute og spiller litt fotball mot Emilie. Det som nå er nytt er at hun ikke løper så mye rundt lenger. Hun viser tegn på å være litt slapp og giddalaus.\r\nVidere kan hun nå legge seg i senga og surfe på nettet. Hun er blitt mye flinkere til å slappe av og lytte til kroppens signaler. Og det er supert.  '),
(71, '2016-08-23 04:00:00', '2016-08-23 19:02:37', 5, 'CONFLICT', 'Vil ikke spise Middag', 'Emilie gjemmer unna deler av middag og deserten. Hun drikker verken juicen eller fresubinen. Hun blir litt frustrert når jeg påpeker dette. Hun gjemmer unna selv når jeg sitter ved siden av henne. Alt går stille og rolig for seg pg hun er nå på rommet sitt. Jeg lar henne bare være der og ser bare hvordan det utvikler seg. \r\nHun skulle spilt kamp i dag, men det har meldt avbud, siden hun ikke spiser.\r\nHun ønsker ikke å snakke og vil bare være litt alene på rommet sitt og det er greit.\r\nEtterhvert gikk hun ut en times tid og drakk fresibin og juice når hun kom tilbake.\r\nSkal be henne skive i dagboken sin. Alt har foregått i ro og mak. '),
(72, '2016-08-25 05:22:00', '2016-08-25 05:32:40', 5, 'INFO', 'Trening', 'Emilie sliter med å gå opp i vekt og har forsatt ett anstrengt forhold til det. Hun liker seg der hun er nå. Det å starte opp med organisert trening nå synes jeg ikke er noen god ide. Selv om hun har veldig lyst til å begynne på løpetrening. Som forøverig er en utsatt idrett hva spiseforstyrrelse angår.\r\nHun har fotballen og der kan hun få være med på både treninger og kamper, gitt at hun viser god progresjon hva vekten angår.\r\nSamt at hun er da villig til å ta til seg ekstra næring etter en treningsøkt eller kamp.\r\nJeg gjør hele tiden fortløpende evalueringer og betraktninger av reglene og justere de ihht. hennes progresjon.'),
(73, '2016-08-31 03:54:00', '2016-08-31 04:02:07', 5, 'INFO', 'Fotball', 'Det forunder meg litt at Emilie vise liten interesse for å være med på fotball treningen og kamper igjen. Dette på trass av at jeg har sagt at hun kan få lov til å starte opp med det igjen.  Jeg har derfor bestemt meg for å  vente til hun tar initiativ selv, fremfor å hele tiden minne henne på om treninger og kamper. Dette gjelder all aktivitet, vi skal ikke stresse dette, men avvente til hun selv spør og tar initativ til begynne igjen.'),
(74, '2016-08-31 04:55:00', '2016-08-31 04:58:13', 5, 'INFO', 'gymtime', 'Har tilbudt Emilie å være med i gymtimene mot at hun da ikke sykler til skolen de dagene.\r\nHun vil tenke på det, virker som om hun da heller vil sykle.'),
(75, '2016-09-08 05:50:00', '2016-09-08 05:59:26', 5, 'INFO', 'Vektreduksjon', 'Ved siste måling har emilie gått litt ned i vekt. Etter skolestart har det blitt mer ansvar på henne hva måltider angår. Jeg har også begynt å jobbe noe som gjør oppfølgingen mer utfordrende. Vi bare fortsetter som før og ser hvordan vekten.\r\nutvikler seg ved neste måling. \r\nHun er flink til å spise og er mer og ner styrt av sulten. Humøret svinger dog litt mer men  \r\nhåper det er grunnet pubertiteten. Hun er også flinkere til å slappe av og sier nå faktisk titt og ofte at hun ikke gidder å gå ut å spille fotball eller gå tur. Hun har også begynt å lese mer i bøker. Ting ser bra ut men vi må forsatt følge nøye opp og ikke tro at kampen er over. Det er fortsatt mye som plager henne psykisk.'),
(76, '2016-09-10 20:59:00', '2016-09-10 21:00:30', 5, 'INFO', 'Trening', 'Tok med Emilie på en liten treningstur rundt voldsløkka i dag. Vi løp intervall, 3 ganger rundt øvre del. Og hun løper nå like fort som meg.'),
(77, '2016-09-12 20:53:00', '2016-09-12 20:59:22', 5, 'CONFLICT', 'Middag', 'Emilie kom hjem til middag etter å ha vært på tur med mamma hele dagen. Hvor det også hadde vært uoverstemmelser underveis. Hun slo seg vrang under middagen og ville ikke spise. Hun raste litt rundt omkring i vel 30 minutter. Skrek, ropte, gråt, slo i veggen og trapet i gulvet.\r\nJeg forholdt meg rolig hele tiden. Andreas satt opp på rommet sitt. Hun roer seg til slutt og spiste middag. Hun vil ikke snakke om det og heg har bedt henne om å skrive det ned i dagboken sin. Dette viser bsre at vi fortsatt har en lang vei å gå. Det er utrolig viktig å holde fast på de reglene og rammen vi har rundt måltidene.'),
(78, '2016-09-18 15:24:00', '2016-09-18 15:28:51', 5, 'INFO', 'Gjemmer mat', 'Emilie holder fortsatt på å gjemme unna mat, I dag fant jeg to brødskiver i kjøkkenskuffen, som nok var fra kveldsmaten i går.\r\nDette viser bare at jeg må følge mye bedre med og ikke stole for mye på det hun sier å ha gjort. Mat er fortsatt i høyeste grad problematisk for henne.\r\nJeg må skjerpe meg å følge henne bedre opp. Nå har jeg gitt henne litt for mye ansvar.'),
(79, '2016-09-20 21:01:00', '2016-09-20 21:05:25', 5, 'INFO', 'Drikke juice', 'Helt ut av ingenting fikk emilie problemer med å drikke juicen til middag. Alt gikk rolig for seg og jeg presset bitt kitt på for at hun skulle drikke opp. Noe hun også til slutt gjorde. Dette viser bare at sykdommen henger fortsatt godt i henne. Men hun overvinner den nå mye oftere. Men hun kjemper hardt og det er vondt å se på.'),
(80, '2016-09-25 06:50:00', '2016-09-25 06:54:00', 5, 'INFO', 'Eplekake', 'I går bakte emilie eplekake og hun spiste ett lire stykke av den selv. Hun fant en oppskrift på nett og gjorde alt selv. \r\nEplene hadde hun høstet inn fra bergslia. Hun er så flink og selvstendig. Kaka ble super god.'),
(81, '2016-09-25 06:54:00', '2016-09-25 07:01:25', 5, 'INFO', 'Vanskelig', 'Hun synes det er vanskelig å snakke om problemene sine vedrørende mat. Derfor ber jeg henne skrive litt om det når de oppstår. Noe hun også gjør. Dette er viktig, hun må bli bedre på å snakke og fortelle oss når hun sliter. De vil hjelpe både henne og oss massa. Hun blir litt bedre på alt hele tiden. Men ser også at gamle problemer dukker opp igjen med en litt ny vri. \r\nDet er nok også veldig tungt for henne å ikke ha noen beste venninne. Men hun er veldig flink til å ta kontakt med de andre jentene i klassen. Og hun leker og pmgås jevnlig med flere av dem. Så jeg tror dette vil ordne seg på sikt. Hun spiser bra og er mer og mer styrt av sulten. '),
(82, '2016-09-26 16:58:00', '2016-09-27 20:07:44', 5, 'INFO', 'Gjemt unna mat', 'Fant to brødskiver i kjøkkenskuffen, hun gjemte nok de unna i går. Hun har gitt meg en skriftelig forklaring på hvorfor så skjedde. Hun liker ikke å snakke om slikt, derfor ber jeg henne om å skrive det ned. Jeg er nødt til å få innskit i hvordan hun tenker og årsaken til hennes handlinger for å kunne hjelpe henne.'),
(83, '2016-09-27 20:07:00', '2016-09-27 20:16:38', 5, 'INFO', 'Veiing', 'Avtale er at hun skal veie seg hver tirsdag morgen. Hun synes det er problematisk å veie seg og er bekymret for hva hun kan finne på hvis vektøkningen er stor. For å stresse henne ned litt har jeg da bare veie henne hver 14 dag de siste gangene. Dette da jeg er trygg på at hun får i seg nok mat og viser litt progresjon hele tiden. Uansett, vet jeg nå ikke hvilke tilltak som må gjøres hvis hun går ned i vekt en uke. Må da kanskje følge hvert enkelt måltid bedre opp.\r\nHun har ikke høy aktivitet og er blitt flinkere til å slappe av.  Dette mye grunnet at hun sykler til skolen hber dag. Det er liksom hennes treningsøkt hver dag. Hun har fortsatt problemer med valg av mat og holder kontroll på kalori inntaket. Psykisk er det fortsatt en lang vei å gå. Tror heller ikke at hun har kommet i puberteten. '),
(84, '2016-10-01 18:29:00', '2016-10-01 18:31:39', 5, 'INFO', 'SMS fra emilie', 'Det er greit hvis jeg ikke får være med til Norefjell fordi jeg dro til mamma for å spise middag nå, for jeg har problemer med at du skal veie meg før og etter turen. Jeg takler det ikke, at jeg skal veie meg to ganger på en uke synes jeg ikke en tur på 3 dager er verdt. Da vil jeg heller droppe den turen enn og veie meg etter turen i tillegg. Jeg synes det er vanskelig\r\n\r\nDet eneste jeg har lyst til er å bli frisk så jeg kan leve et normalt liv, for enn hva jeg gjør, så er denne greia med meg og setter regler som gjør at ingenting blir gøy for meg. For meg er det like umulig å skjønne hvordan en person kan spise hamburgere og kebab som det er for den personen og skjønne seg på min sykdom.'),
(85, '2016-10-09 07:31:00', '2016-10-09 07:34:23', 5, 'INFO', 'Høstferie', 'Emilie og Andreas var med mamma til norefjell i høstferien, de var der fra 2.10 -5.10.2016. Emilie sier at alt har gått greit hva måltider angår.'),
(86, '2016-10-09 07:37:00', '2016-10-09 08:27:27', 5, 'INFO', 'Løpetur', 'Tok med emilie på en løpetur fra sognsvann og opp til voksenkollen og ned igjen, som er vel ca 6-7 km.\r\nHun spiste lunsj etterpå, men jeg må fortsatt mase og følge nøye med på henne slikt at hun tar til seg ekstra næring etter en treningstur. \r\nJeg tar med Emilie på slike løpeturer for å vise henne at hun nå er mye sterker og løper fortere enn da hun var tynnere. Og nå løper hun faktisk fra meg også.\r\nSå jeg håper dette har en viss terapautisk effekt på henen hva inntak av næring og sitt forhold til kropp angår.'),
(87, '2016-10-09 08:27:00', '2016-10-09 08:33:28', 5, 'INFO', 'Maten', 'Emilie styrer mer måltidene selv, som er en bervist handling fra min side. Hun er flink til å spise og sulten styrer stor sett det meste. Utfordringen er nok de valg av mat hun gjør, samt at hun fortsatt holder god kontroll på inntak av kalorier. Mengen hun spiser er det ingenting å si på, men hun velger stort sett mager mat og har fortsatt problemer med å innta fettholdig mat. Hun har begynt å droppe frukt til frokost og lunsj, så her må vi følge opp hvert måltid. Dessert må vi også passe på at hun tar.  '),
(88, '2016-10-09 08:33:00', '2016-10-09 08:37:06', 5, 'INFO', 'Vekst', 'Normalvekt og høyde for jenter 14 år er 52 kg og 163 cm og jeg tenker at dette er ett naturlig mål for Emilie.\r\nDet viktigste å formiddle til henne er at hun fortsatt skal opp i vekt og at kroppen hennes vil utvikle og forandre seg masse. Dette er noe hun må forstå og akseptere og her har vi en jobb å  gjøre.');
INSERT INTO `event_log` (`id`, `created_date_time`, `last_modified_date_time`, `fk_user_id`, `level`, `title`, `content`) VALUES
(89, '2016-10-09 09:24:00', '2016-10-09 20:37:14', 5, 'INFO', 'Terapi', 'Tenker at vi må øke litt på intensiviteten hva terapi angår. de siste gangen har Emilie gått alene til BUP. Dette etter mitt ønske. For jeg synes hun snakker og sier alt for lite i de timene. Det er stort sett BUP og jeg som står for snakkingen. BUP ønsker at vi skal starte med familie terapi. Noe jeg ikke er helt klar for. Dette med tanke på å involvere Andreas, samt at ejg ikke ønsker å gå i terapi sammen med mamma, grunnet vår dårlige kommunikasjon og totalt forskjellig syn på hva som er veien videre.\r\nJeg sliter med å se en helhetlig plan i den behandlingen BUP utfører og ønsker derfor å prøve en privat behandler. Har meldt oss inn i <a href="http://www.nettros.no/senter/oslo/">ROS</a> og ser at de også tilbyr terapi.'),
(90, '2016-10-21 20:28:00', '2016-10-21 20:37:29', 5, 'INFO', 'Fotball', 'Det er ikke lett å bli klok på emilie hva fotball angår. Dette da hun liker veldig godt å spille men viser null i nterresse for å spille eller trene med sagene. Hun er også meget innesluttet hva dette tema angår og vil ikke fortelle meg noe som helst om årsaken til hvorfor hun ikke vil være med. Sagene laget er blitt slått sammen med Korsvoll og alle har meldt overgang til korsvoll. Emilie ønsket ikke være med på dette heller.\r\nJeg har derfor meddelt at hun har sluttet.\r\nUansett, hvis lysten skulle melde seg ikan hun bare starte opp igjen. Jeg ønsker ikke å mase på henne. Hun er nok mye styrt av sykdommen fortsatt, men det sier meg at hun da ikke er klart til å gjennoppta fotball treningen eller annen form for regelmessig trening igjen. Hun blir bare sur når jeg prøver å snakke med henne om dette temaet. Lar defor dette bare bero inntill hun selv tar initiativ til å start opp igjen.'),
(91, '2016-10-21 20:43:00', '2016-10-22 16:58:18', 5, 'INFO', 'Progresjon', 'Fysisk sett går det i riktig retning, men psykisk synes jeg det har stagnert. Hun sliter mer enn vanlig på den fronten. Hun har fortsatt mange av de samme tvangstankene og sliter openlyst med mange valg. Hun har nå også fått tilbake eksem på hendene. Dette er nok grunnet været. Vi er nå inne i en tyngre periode.\r\nHun leker nå sjeldent med noen, det blir mest mamma og meg. Det er heller ikke helt bra.'),
(92, '2016-10-22 16:58:00', '2016-10-22 17:04:32', 5, 'INFO', 'løpetur', 'Emilie spurte om jeg ville være med på en løpetur i dag. Noe jeg syntes var greit siden hun ikke ble med på Haslum fotball cup. Vi løp 2 runder rundt sognsvann, hvor en var rolig og en var full fart. Emilie løp rundt på 13:40 og jeg på 14:08. Hun har formelig sprudlet etterpå og synes nok det var godt å knuse meg. Jeg tror også dette er veldig bra for psyken hennes at hun ser at kroppen svarer i form av stryke når hun går opp i vekt.'),
(93, '2016-10-27 20:03:00', '2016-10-27 20:07:09', 5, 'INFO', 'Fotball', 'Tror nok mye av grunnen til at emilie ikke er så lysten på bli med over til korsvoll er at elin har også gått over fra lyn til korsvoll.\r\nHar nevnt lyn for henne, men hun vil helst spille sammen med sagene jentene. \r\nAlt er nå opp til henne å ta initiativ. Vi skal ikke spørre eller mase på henne om dette.\r\nJeg har sagt at hun nå kan få trene en gang i uken.'),
(94, '2016-10-27 20:07:00', '2016-10-27 20:09:37', 5, 'INFO', 'Samvær', 'Emilie kan nå få være hos mamma en dag i uken. Har bedt henne om å bestemme seg for en dag.'),
(95, '2016-10-31 21:40:00', '2016-10-31 21:43:06', 5, 'INFO', 'Eksem', 'Emilie har nå fått veldog tørr hud og eksem på hendene sine. Tror det er på grunn av at det er blitt kaldere. Hun må smøre hendene\r\nhver morgen og kveld, samt bruke votter/eller hansker. Det er slitsomt å minne henne på dette hele tiden.'),
(96, '2016-11-01 21:41:00', '2016-11-01 21:42:30', 5, 'INFO', 'Veiing', 'Emilie slo seg vrang og ville ikke veie seg i dag tidlig. Jeg lot henne bare få viljen sin.'),
(97, '2016-11-03 21:49:00', '2016-11-03 21:53:11', 5, 'INFO', 'Lett produkter', 'Emilie handler mye på egenhånd og vi må følge nøye med så hun ikke velger lett produkter. Ser nå at hun har en lei tendens til det.\r\nHun velger fortsatt mat med lavt fett og kaloriinnhold. Og det er nettopp her vi må følge nye med. Hun blir fort sint og innesluttet hver gang jeg tar dette opp med henne. Hun har fortsatt en lang vei å gå hva det psykiske angår.\r\nLett produkter er ikke tillatt. Kun lett melk og brelett.'),
(98, '2016-11-11 23:00:00', '2016-11-13 22:55:23', 5, 'ACTIVITY', 'Trening', 'Vi splite litt fotball og så løp Emilie løp en runde rundt Voldsløkka.'),
(99, '2016-11-12 23:10:00', '2016-11-12 23:11:18', 5, 'ACTIVITY', 'Fotball', 'Vi spilte fotball på voldsløkka. Hadde også litt sprinttrening'),
(100, '2016-11-13 22:53:00', '2016-11-13 22:54:35', 5, 'ACTIVITY', 'Fotball', 'Vi spilte litt fotball på Voldsløkka'),
(101, '2016-11-13 22:55:00', '2016-11-15 22:22:31', 5, 'CONFLICT', 'Konfirmasjonsmøte', 'Emilie skulle på konfirmasjonsmøte i dag kl. 1100 og mamma skulle komme å hente henne kl. 1030.\r\nAlt starte vel og bra, hun stod opp 0930, dusjet og så begynte hun å lage seg en smoothie til frokost. Problemet begynte da hun ikke var fornøyd med smaken og måtte lage en ny. Dette førte til at hun ikke ville rekke å spise frokost før hun dro på møte. \r\nHun ville derfor spise mens hun gikk bort. Noe jeg ikke godtok og sa hun måtte sette seg ned å spise frokost før hun gikk.  Dette førte til at hun gradvis ble hysterisk og mistet helt kontrollen over seg selv. Hun ble veldig utagerende, raste rundt, smalt med dører, kastet ting, og sa hun ville slå meg og masse annet. Jeg måtte gå fysisk til verks for å stoppe henne, dvs. legge henne på gulvet og holde henne i ro. Men hun hylte og skrek så fælt at jeg slapp henne. Jeg prøvde også å holde henne fast uten hell. La henne atter en gang på gluvet i kanskje 30 sekunder. Men hun roet seg ikke da heller. Mens det hele pågikk stod mor utenfor og ringte på. Noe jeg valgte å ignorere. Emilie ville ikke høre på verken meg eller henne. Hun var som i en transe, helt umulig å trenge inn til henne. Hun bare gikk frem og tilbakw og stresset seg sevl opp, gråt og var veldig frustrert. Jeg ble kontaktet av barnevernsvakten fordi mor hadde ringt dem. Etterhvert roet hun seg ned og var veldig opptatt av å få spist. \r\nFra da og utover fikk jeg kontroll over henne igjen og kunne begynne så smått a ha en dialog ned henne. Hele opptrinnet varte kanskje 30 minutter. Hun kom relatvit raskt til seg selv igjen og vi fikk tilbake den gode tonen oss imellom igjen. Jeg ble litt overrasket over at hun fortsatt kan få slike kraftige utbrudd basert på bagateller. Dette viser bare at vi jar en lang vei å gå og må vurdere ytterlige tiltak i from av behandling.\r\nDet gjør uttolig vondt i hjertet å måtte ty til fysiisk makt mot henne, men jeg vet ikke hva jeg ellers kan gjøre der og da. Jeg klarer ikke å stå å se på at hun raser rundt slik. Og har ikke noe annet virkemiddel. Det er også til ettertanke at andreas overværete hendelsen. Har snakket med han om dette, men det plager meg at han opplever slike hendelser. '),
(102, '2016-11-18 20:57:00', '2016-11-18 20:58:31', 5, 'ACTIVITY', 'Fotball', 'Vi spilte fotball på Voldsløkka'),
(103, '2016-11-18 21:00:00', '2016-11-18 22:33:09', 5, 'INFO', 'Skole', 'Emilie sykler ikke til skolen mer grunnet glatte veier. Hun går nå til tåsen og tar trikken opp til kringsjå. Hun sluttet å sykle 14.11.2016. Hun har derfor sluttet med den ekstra flaken med fresubin hun drakk hver gang hun syklet.'),
(104, '2016-11-19 17:16:00', '2016-11-19 17:24:43', 5, 'ACTIVITY', 'Løpe trening', 'Vi har hatt ca 45 minuttet løpetrenning.\r\nHun drakk en YT etterpå.\r\nSelv etter en slik økt er hun ikke helt fornøyd og vil bare holde på mer. Ei tar hun eller spør om drikke etterpå. Jeg må påse at hun drikker. Hun har nå ingen faste aktiviteter og sykler i&#311;ke til skolen mer, derfor trene jeg nå litt sammen med henne.\r\nMen må helt klart være påpasselig hva nengde angår, for hun har ingen grenser selv. Det er vanskelig å vite hva som er rett eller galt i denne sammenhengen. Videre er det utfordrende å vite om det er emilie eller sykdommen som har kontrollen under en treningsøkt. Det er fortsatt en lang vei å gå psykisk før hun er frisk. Hun er veldig nærtagen og vli sjeldent snakke om verken mat eller trening. Noe som er ett dårlig tegn.'),
(105, '2016-11-20 22:30:00', '2016-11-20 22:31:25', 5, 'ACTIVITY', 'Fotball', 'Vi spilte litt fotball på voldsløkka'),
(106, '2016-11-22 07:24:00', '2016-11-22 07:32:56', 5, 'CONFLICT', 'Veiing', 'Hun har hatt en liten vektreduksjon denne uken, noe som skapte dårlig stevning. Spesielt hos meg. Hun spiser bra hele tiden og har sluttet å sykle til skolen, så jeg vet ikke hvorfor hun nå synes å ha stablisert seg rundt 46.7 kg. Hun tar også ekstra næring etter en aktivitet. Jeg tror nok hun spiser for mager mat og har selv god kontroll på inntak og aktivitet, og klarer derfor å juster mengen selv. Det er min hypotese, akkurat nå. Ønsker ikke å endre på dietplanen. Jeg må heller bli flinkere til å passe på og følge opp. Hun har nå kanskje blitt gitt for mye kontroll. Hun lager mye av maten selv og her må jeg nok i større grad ta over. Noe som da vil være en kilde til flere konflikter, vil jeg tro.\r\nVi venter og ser an utviklingen til neste uke og tar eventuelle grep  da hvis vekten ikke øker igjen.'),
(107, '2016-11-24 07:01:00', '2016-11-24 07:06:39', 5, 'INFO', 'Dessert', 'På forespørsel svarer emilie at hun spiste smultring til dessert i går. Hun bekrefter det  atter en gang når jeg spør igjen. Hun hadde ikke spist smultring til dessert da jeg ser at det ikke er tatt noen fra posen. Så i dette tilfellet lyver hun bevist. Med andre ord vi kan ikke stole på henne hva matinntak angår. Hun svare etter eget forgodtbefinnende. Vi må skjerpe oppfølgingen rundt alle måltidene. Slik det er nå styrer hun for mye selv. Så her må vi gå ett skritt tilbake. '),
(108, '2016-11-26 17:04:00', '2016-11-26 17:07:35', 5, 'INFO', 'Kontroll av måltider', 'Fant nettopp en liter med skummet melk som emilie hadde gjemt i kjøleskapet. Noe som bare bekrefter at måltidene må kontrolleres mye bedre. Hun prøver nå å lurer seg unne på mange nye måter. Noe som også reflekteres i at vekten går noe nedover. Regler og kontroll må skjerpes.'),
(109, '2016-11-26 22:40:00', '2016-11-26 23:00:40', 5, 'REPORT', 'Oppsummering uke 47', '- Emilie bruker alt for lang tid på noen måltider. Innfører derfor 30 min reglen igjen.\r\n- Hun lager nå maten selv for ofte, særlig middag\r\n- Jeg må bli bedre på å følge opp måltidene\r\n- Jeg skal lage middag.\r\n- Hun skal ikke gå så ofte i butikken å kjøpe mat\r\n- Hun har snik drukket skummet melk\r\n- Hun sier at fett i maten er veldig vanskelig\r\n- Det er vanskelig å få henne til å overnatte hos mamma\r\n- Vektstabilliseringen skyldes nok at hun har sabotert diet planen. \r\n- Vi skal ikke øke dieten. Bedre oppfølging vil føre henne på rett kurs ogjen\r\n- Hun har hatt ett normalt aktivitetsnivå\r\n- Hun er stort sett blid og fornøyd og spiser bra.\r\n- Har hatt norsk og engelsk tentamen denne uken'),
(110, '2016-11-26 22:50:00', '2016-11-26 22:51:24', 5, 'ACTIVITY', 'Fotball', 'Vi spilte en vanlig runde fotball på voldsløkka i dag'),
(111, '2016-11-27 17:02:00', '2016-11-27 17:03:15', 5, 'ACTIVITY', 'Skøyter', 'Vi har gått på skøyter på bergbanen i dag'),
(112, '2016-11-27 17:03:00', '2016-11-27 21:47:11', 5, 'CONFLICT', 'Middag', 'I dag ble det konflikt ved valg av middag. Hun ville ha fiskeboller, men på sin måte. Noe jeg ikke godtok. Det skal vøre med hvit saus og poteter.Og det er sausen som skapte problemer for henne. Hun nekter å spiser, raste rundt og smalt med døren til rommet sitt. Jeg tok hardt i henne og da roet hun seg litt. Men skrek mange ting til meg. Ba henne om å gå ut litt for å roe seg ned men det vil hun ikke. Dette viser bare hvor syk hun fortsatt er og hvor viktig det er at jeg igjen tar mer kontroll over måltidene.\r\nUtbruddet var ikke så kraftig og hun roet seg etter ca 30 minutter. Da satt hun seg uoppfordret ned og spiset opp fiskebollene og sausen. Litt tidligere hadde hun most maten som lå på tallerkenen med hendene.\r\n\r\nHun blir veldig lei seg etterpå og jeg snakker mye med genne etter slike episoder. Dette for å forsikre henne om at vi er like glad i henne og at jeg vet at det et sykdommen som gjør at hun mister kontrollen. Det som vsr nytt denne ganger var at hun var så lei og sa at hun ikke orket mer og ønsket ikke å leve. Noe hun aldri har sagt før. Det som er positivt er at hun er veldog lett å få på rett vei igjen bare ved å snakke med henne. Hun kommer da fort til hektene og den glade og gode jenta  vender da tilbake. Men dette må tas seriøst, hun har det fryktelig vanskelig og vondt inn i seg. Og det spesielt i slike sitasjoner.'),
(113, '2016-12-01 22:53:00', '2016-12-03 23:06:39', 5, 'INFO', 'Andreas', 'I dag fikk andreas ett kraftig raserianfall fordi nett forbindelsen ble brutt. Han beskyldte meg for å ha gjort det. Noe som var helt feil og gjorde meg også forbannet.\r\nHan bannet, hylte og skrek, samt sparket til ting på rommet sitt. Det var helt umulig å roe han ned. Så jeg gikk ned i stuen og lot han holde på. Etter vel 15 minutter roet han seg. Jeg fortalte at slok oppførsel er helt uakseptabel og var gansk så sint på han. Derfor ba jeg han om å umiddelbart det til sbp. Dette slik at jeg ikke skal kjefte han huden full. Han har null respekt og viser ongen tegn til anger, smarere tvert imot, han forsvarer det nesten. Konsekvensen er at jeg har tatt fra han pc og gitt han forbud mot dataspill. Så for tiden vise om han har lært noe. Jeg er i tvil, fordi han viser ingen tegn til å be om unnskyldnig eller ønske om å forklare seg om hvorfor han ble så sint for ingenting. Det er heller ikke første gangen han er utagerende og svært provoserende mot meg. Jeg må søk etter hode tiltak for å få han til å forstå at slik kan han ikke holde på. Jeg blir voldsomt skuffet av han og trenger mange dager for klare å legge slike hendelser bak meg.'),
(114, '2016-12-03 20:47:00', '2016-12-05 20:48:57', 5, 'ACTIVITY', 'Fotball', 'Emilie, Andreas og jeg spilte fotball på voldsløkka'),
(115, '2016-12-05 21:41:00', '2016-12-05 21:45:11', 5, 'INFO', 'Veiing', 'Emilie har skrevet ett brev til meg hvor hun spør om å få utsette veiingen i morgen. Dette fordi hun plages fælt etterpå. Helt uavhengig av om hun har gått opp eller ned.\r\nHun har nynorsk fagdag i morgen, så vi har utsatt veiing til onsdag morgen.  '),
(116, '2016-12-06 20:30:00', '2016-12-06 20:31:59', 5, 'INFO', 'Måltider', 'Emilie kjøper fortsatt lett produkter og snik spiser dette når jeg ikke følger med. Fant nå lett ost og ekstra lett melk i kjøleskapet.'),
(117, '2016-12-06 20:33:00', '2016-12-06 21:36:56', 5, 'REPORT', 'Oppsummering uke 48', '- Dette har vært en roligere uke hva konflikter angår. Hun er stort sett i godt humør\r\n- Hun snikspiser lett produkter, lett ost og ekstra lett melk\r\n- Lite aktivitet\r\n- Liker ikke å veie seg, sliter med å sove natten før veiing\r\n- Tvangstanker, trenger hjelp til å håndtere disse, når noen forsvinner dukker nye opp.\r\n- Oppsøker og leker med venner\r\n-Jeg må skjerpe meg hva oppfølging av måltider angår\r\n- Nynorsk og tysk tentamen'),
(118, '2016-12-07 21:50:00', '2016-12-07 22:01:43', 5, 'INFO', 'Vektøkning', 'På de siste 6 ukene har andreas gått opp 1.1 kg i vekt, mens emilie har kun gått opp 100 g. Vi kan selvfølgelig ikke sidestille dem, men det gir oss en liten pekepinn på hva som er normalt.\r\n\r\nHvis man ser på fra jeg startet å veie andreas har han gått opp 1.6 kg og i samme periode har emilie gått opp 3.3 kg.\r\nNoe som jo er interesant, fordi det viser at emilie faktisk har en god progresjon over tid. Men det går for sakte fremover og det kan hemme hennes utvikling. '),
(120, '2016-12-09 09:44:00', '2016-12-11 09:45:16', 5, 'ACTIVITY', 'Fotball', 'Emilie og jeg spilte fotball på voldsløkka'),
(121, '2016-12-11 05:23:00', '2016-12-13 05:24:28', 5, 'ACTIVITY', 'Fotball', 'Andreas, Emilie og jeg spilte fotball på voldsløkka'),
(122, '2016-12-13 14:53:00', '2016-12-13 14:57:57', 5, 'INFO', 'Vektøkning', 'Emilie går ikke opp i vekt og jeg må vurdere å søke om plass på rasp. Det er blitt vanskligere å stole på henne hva mat angår. Hun finner stadig på nye ting og sniker seg unna reglene titt og ofte. Jeg sliter med å følge henne opp skikkelig. Hun har liten aktivitet og vil gå opp i vekt hvis kostplanen følges. Det er jeg ganske sikker på. Så kontrollen må skjerpes og det er netopp det jeg sliter med.'),
(123, '2016-12-14 23:08:00', '2016-12-13 23:09:56', 5, 'INFO', 'Blodprøve', 'Har tatt blodprøve på ullevål sykehus i dag,\r\ndette etter ønske fra legen på bup.\r\n'),
(124, '2016-12-13 23:18:00', '2016-12-13 23:24:08', 5, 'REPORT', 'Oppsummering uke 49', '- Ingen vektøkning\r\n- Lite aktivitet\r\n- Ingen konflikter\r\n- Spiser mye, men mager kost og hun holder regnskap på kalori inntaket\r\n- Har ikke klart å følge opp måltidene bedre. Må bli flinkere til det for at hun skal få vektøkning.\r\n- Ingen endring i hva hennes tanker og forhold til mat angår. Her har ting stått stille kenge.'),
(125, '2016-12-17 10:23:00', '2016-12-17 10:27:59', 5, 'INFO', 'Matlaging', 'Emilie lager mye av maten sin selv. Hun har begynt å varmebehandle mye av det hun spiser. Mat stekes og kokes veldig lenge. Slik at det er helt på grensen til å bli brent. \r\nJeg har misstanke om at hun gjør dette for å fordrive fett og andre uønskede næringsstoffer. Hun blir sur når jeg konfronterer henne med dette. Hun bør nok ikke lage maten selv. Vi må skjærpe kontrollen. '),
(126, '2016-12-18 07:13:00', '2016-12-19 07:14:16', 5, 'ACTIVITY', 'Skøyter', 'E, A og jeg gikk på skøyter på bergbanen'),
(127, '2016-12-17 07:14:00', '2016-12-19 07:15:54', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka'),
(128, '2016-12-20 07:20:00', '2016-12-20 07:25:28', 5, 'INFO', 'Vektøkning', 'Endelig en bra vektøkning. Vi har ikke gjort noe annerledes denne uken.  Jeg har bare fulgt litt bedre med under måltidene. Men hun spiser bra og mye hele tiden. Så det er ikke lett å forstå hvorfor hun ikke har en jevn økning hver uke, fremfor å hoppe litt opp og ned i vekt. Etter en litt stor vektoppgang pleier hun å gå litt ned igjen og stabilisere seg en periode, før hun så går litt opp igjen. Tror vi bare må ha tålmodighet og følge henne opp hele tiden.'),
(129, '2016-12-20 14:20:00', '2016-12-20 14:23:30', 5, 'INFO', 'Lett produkter', 'Fant skummet melk og ekstra lett ost i kjøleskapet som hun da tar av når jeg ikke følger med eller når hun er alene. Vi må følge nøye med. Dette er ikke bra og viser bare at hun har mye psykisk å jobbe med.'),
(130, '2016-12-21 06:54:00', '2016-12-21 07:00:28', 5, 'REPORT', 'Oppsummering uke 50', '- Vektøkning på 0.6 kg\r\n- Jeg følger bedre med under måltidene\r\n- Snikspiser fortsatt lett produkter\r\n- Ingen konflikter\r\n- Normal aktivitet\r\n- Stort sett blid og fornøyd\r\n- Oppsøker venner'),
(131, '2016-12-21 23:33:00', '2016-12-31 10:17:16', 5, 'INFO', 'Treningsprogram', 'Emilie har gitt meg det treningsopplegget hun fulgte før hun ble innlagt. Dette er ett programm hun har laget helt selv og holdt hemmelig for meg. Må finne ut hvor ofte hun kjørte dette programmet.\r\n<p>\r\nDette programmet kjørte hun ca 1-2 dager i uken, ca 2 timer pr  gang.\r\n<h4>45 reps</h4>\r\n<li>Pushups med motsatt ben\r\n<li>Dips\r\n<li>Superman /planke og løfte armene\r\n<li>Sykle\r\n<li>Benhev\r\n<li>Planke og motsatt ben\r\n<li>Armene fra side til side \r\n<li>Pushe bakover\r\n<li>Spensthopp\r\n<li>Squats\r\n<li>Hip thrust\r\n<li>Catslide \r\n<li>90*\r\n<li>Step up på stol \r\n<li>Utfall fremover\r\n<li>pBulgarsk utfall til siden\r\n<lip>Jumping jacks (200)\r\n</p>\r\n<p>\r\n<h4>1 min</h4>\r\n<li>V-form\r\n<li>Overkroppen oppe\r\n<li>Bena oppe\r\n<li>Planke\r\n\r\n<h4>HELKROPPSPROGRAM</h4>\r\n<li>45 grader\r\n<li>pushups :-(\r\n<li>Dips\r\n<li>Superman\r\n<li>V-UPS :-(\r\n<li>Sykle\r\n<li>Crunch\r\n<li>Planke og motsatt ben\r\n<li>løfte motsatt arm og ben på mage\r\n<li>Armene fra side til side x2\r\n<li>Pushe bakover\r\n<li>Stjerne og løfte ben\r\n<li>Spensthopp :-(\r\n<li>Catslide :-(\r\n<li>Moutain climbers\r\n<li>Bulgarsk utfall til siden\r\n<li>Bulgarsk utfall fremover fra seng \r\n<li>Squats\r\n<lu>Hip trust\r\n<li>90 grader\r\n<lu>Jumping jacks \r\n\r\n<p>\r\n<h4>1 min</h4>\r\n<li>V-form\r\n<li>Bena oppe\r\n<li>Overkroppen oppe\r\n<li>Planke\r\n<li>Sideplanke\r\n<li>Wall sit'),
(132, '2016-12-23 23:05:00', '2016-12-23 23:06:25', 5, 'ACTIVITY', 'Skøyter', 'E og jeg gikk på skøyter på bergbanen i dag'),
(133, '2016-12-24 21:07:00', '2016-12-24 21:07:44', 5, 'ACTIVITY', 'Fotball', 'A, E og jeg spilte fotball på voldsløkka'),
(134, '2016-12-24 21:08:00', '2016-12-24 21:12:19', 5, 'INFO', 'Matlaging', 'Hun velger ofte tunfisk på boks til måltidene. Hun steker den lenge. Tunfisk er veldig magert og kan derfor ikke telle som en del av måltidet. Hun holder på med mate nesten hele tiden når hun er inne. Så her må jeg stramme inn, noe som nok vil skape flere konflikter.'),
(135, '2016-12-25 20:17:00', '2016-12-25 20:18:03', 5, 'ACTIVITY', 'Skøyter', 'E og jeg gikk på skøyter på bergbanen'),
(136, '2016-12-26 08:41:00', '2016-12-27 08:43:00', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka i går.'),
(137, '2016-12-27 08:43:00', '2016-12-27 08:51:15', 5, 'INFO', 'Terapi', 'Vi skal begynne å gå i familieterapi. Det er ok at kun en av oss er med. Og andreas trenger heller ikke bli med.\r\n\r\nMadly går av med pensjon sommeren 2017 så vi må ha ett møte med henne om veien videre. Jeg tenker at da er nok det beste å finne en ny så snart som mulig..\r\n\r\nForøvrig er jeg undrende om den terapi som nå gis har noen effekt. På meg har den negativ påvirkning, derfor har jeg trukket neg litt tilbake.'),
(138, '2016-12-27 09:27:00', '2016-12-27 09:33:03', 5, 'INFO', 'Vektnedgang', 'Vi tror vektnedgangen skyldes juleaften samt at hun også har droppet desert noen dager. Vi har også gått på skøyter.\r\nKonklusjon jeg må følge opp bedre.'),
(139, '2016-12-27 23:05:00', '2016-12-27 23:10:05', 5, 'REPORT', 'Oppsummering uke 51', '- gått 700g gram ned i vekt\r\n- slurvet med dessert\r\n- for dårlig oppfølging av måltidere\r\n- ikke flink nok til å ta til seg ekstra næring etter en aktivitet\r\n- liker fortsatt ikke å veie seg\r\n- ingen konflikter\r\n- stort sett blid og fornøyd'),
(140, '2016-12-27 23:10:00', '2016-12-27 23:14:11', 5, 'INFO', 'Emilie', 'Hun forteller at hun ikke kan huske å ha vært opptatt av fettinholdet i mat før hun ble innlagt på ullevål. Videre sier hun at pleide i spise lørdagsgotteri, samt at hun ikke tenkte på det å sitte. Hun sier at dette har endret seg etter sykhusoppholdet. Nå tenker hun på det. '),
(141, '2016-12-27 23:14:00', '2016-12-27 23:20:47', 5, 'INFO', 'Juleferie', 'Hun sier det er vanskelig å reise bort, fordi hun da er redd for å gå ned i vekt på blir veldig stresset av det. Det er vanskelig å resie bort fra de faste rutinene. Hun har lyst, men vet ikke om det er vedt det. Hun får skyldsfølelse fordi hun ikke vil ødelegge ferien for oss andre. Sykdommen følger oss enn hvor vi er og gir oss ikke fred uansett. Snarere tvert i mot, det blir værre når vi reiser bort. '),
(142, '2016-12-28 23:11:00', '2016-12-28 23:13:44', 5, 'ACTIVITY', 'Skøyter', 'A, E og jeg gikk på skøyter på bergbanen i dag. E hadde på seg pulsklokke og fant ut at hun hadde gått ca 1 mil og brukt ca 300 kcal. '),
(143, '2016-12-30 22:39:00', '2016-12-31 10:13:09', 5, 'INFO', 'Måltider', 'Emilie bør ikke lage maten selv, det må vi gjøre. Jeg tar henne titt og ofte i å snikinnføre mager mat. Hun lyver også til meg om hva hun spiser og har spist. \r\nHun bør heller ikke få gå å kjøpe mat i butikken alene. Hun må følges mye bedre opp av oss hvis hun skal klare å ta ett steg videre. Jeg har gitt henne for mye ansvar og tillit. Jeg skal nå følge opp dette bedre.'),
(144, '2016-12-30 23:04:00', '2016-12-30 23:07:26', 5, 'INFO', 'Neglsopp', 'Emilie blir ikke kvitt neglsoppen på pekefingeren. Nå har jeg kjøp en kur som vi begynner med i kveld og som må følges i 3 månder. Den smøres på 1 gang om dagen før hun legger seg.'),
(145, '2016-12-31 10:10:00', '2016-12-31 10:11:53', 5, 'INFO', 'Eksem', 'Hun må smøre hendene sin hver kveld før hun legger seg. Til tider har hun store spår/skorper på hendene. Hun må bruke votter når det er undet 0 grader ute.'),
(146, '2016-12-31 10:36:00', '2016-12-31 10:40:46', 5, 'INFO', 'ROS medlemsblad', 'Vi mottar ROS medlemsbladet en gang i månden. E leser i bladet og vi snakker rundt dette når jeg ser aktuelle temaer.\r\nHun er fortsatt meget opptatt av kosthold og hvordan kroppen fungerer. Men hun tolker mye av dette feil. Så her tenker jeg at det kan være lurt å øke kunnskapen hennes.'),
(147, '2016-12-31 19:19:00', '2016-12-31 19:23:18', 5, 'ACTIVITY', 'Sognsvann rundt', 'Emilie fikk lov til å løpe rundt sognsvann alene. Hun løp 2 runder. En rolig og en rask ybor hun løp på 12:50. Hun var veldig fornøyd og jeg håper med dette at hun skjønner at det å gå opp i vekt bare gjør henne sterkere. Hun har aldri løpt så fort før.'),
(148, '2016-12-31 21:52:00', '2016-12-31 22:39:21', 5, 'CONFLICT', 'Kveldsmat', 'E slår seg vrang under kveldsmaten fordi jeg følger nøye med når hun lager seg ostesmørebrød. Hun begynner plutselig å gråte og sier at hun vil til mamma. Jeg sier at det er greit men at hun da må spise først.\r\nHin små gråter hele tiden og er veldig fortvilet. Jeg tror at sydommen nå herjer med henne og årsaken er nok at jeg følger nøye med på måltidet. Ting går forsåvidt rolig for seg og jeg klare å roe henne ned ved å snakke til henne. Hun sier hun er sulten og sliten og er bare lei av alt. Særlig sykdommen. Hun vil gå til mamma og spise, hvor jeg da sier at hun da kan bli værende hos mamma. Og jeg vil da be bup om å søke plass på rasp. Dette fordi hun vil til mamma for å kunne styre måltidet selv. \r\nHun tok til fornuft og spiste kveldsmaten til slutt. Jeg sa hele tiden at hun kunne få være hos mamma til i morgen såfremt hun spiste kveldsmaten først. Men det var nettopp det hun ikke ville. Alt hat gått rolig for seg hele tiden, men det er utrolig tungt og krevende å få henne på rett vei i slike situasjoner. Nå har hun spist bra og humører hennes ble mye bedre med en gang. Og på forespørsel vil hun nå ikke gå til mamma alikevel. Hun sier forøvirg at hun kan dra til mamma hvis jeg ønsker en hvilepause. Hun har det vondt inne i seg.'),
(149, '2017-01-01 10:43:00', '2017-01-01 10:48:20', 5, 'INFO', 'Ansvar', 'E har fått alt for mye ansvar hva måltider angår. Noe jeg ser i ettertid. Det blir nå uenigheter ved hvert måltid som jeg nå tar kontroll over. Men den kampen må dessverre tas. Hun har ikkw fulgt oppskriftene når hun lager nat selv og lyver når jeg spør, samt at hun bruker lett produkter hvis anledningen byr seg. '),
(150, '2017-01-01 10:57:00', '2017-01-01 11:03:35', 5, 'INFO', 'Smoothie', 'E sier at hun aldri har fulgt oppskriften for smoothie. Og den har hun jo drukket mange av. Så her ligger nok også noe av svaret på hvorfor vekten økningen har uteblitt.\r\nPå forespørsel benekter hun å ha jukset med andre måltider. Men jeg er usikker på om vi kan stole på det. Tenker spesielt på lunsjen som hun spiser på skole. \r\nHvis ikke vi ser en snarlig vektøkning må vi igjen vurdere rasp. Jeg sliter med å følge henne opp og vi kan ikke fortsette slik.\r\n\r\nJeg sier til henne at hun må si ifra når hun kjenner problemene dukke opp under måltidene. Slik at jeg kan da hjelpe henne der og da.'),
(151, '2017-01-01 11:19:00', '2017-01-01 21:25:37', 5, 'REPORT', 'Sammendrag uke 52', '- Hun skal nå overnatte en dag i uken hos sbp.\r\n- Skaper mye støy når jeg tar mer kontroll over måltidene\r\n- Hun vedgår at hun jukser når hun lager smoothie selv\r\n- Har tatt løpetur rundt Sognsvann alene\r\n- Det har vært en tung og slitsom uke\r\n- Litt mer aktivitet grunnet ferie\r\n- Er litt redd hun har begynt å overspise, særlig til kveldsmaten\r\n- Det er blitt vanskeligere å stole på henne, hun er veldig kreativ og finner stadig nye gjemmesteder for mat. Hun må overvåkes hele tiden.Snur jeg ryggen til kan hun finne på noe\r\n- Hun bruker lang tid på å spise\r\n- Hun trenger bedre oppfølging og jeg sliter med dette. \r\n- Viser hun ikke progresjon nå, må vi søke om hjelp.'),
(152, '2017-01-01 11:23:00', '2017-01-01 11:33:38', 5, 'INFO', 'Overspising', 'Jeg er litt bekymret for kveldsmaten. Hun spiser ofte mye og lenge. Tror hun da prøver a kompansere for dagens inntakk og forbruk av kalorier. Noen ganger sier hun at hun blir veldig mett. Jeg prøver da å begrense mengen. Men dette er vanskelig terreng å navigere i, da jeg ikke vet om det er naturlig sult eller om det er sykdommen som styrer henne. Hun blir også forvirret over at hun verken for lov til å spise for mye eller for lite. Her kjører jeg litt slalom med reglene, uten å ha full kontroll. Men så lenge vektøkningen uteblir må jeg gjøre små justeringer. Noen fasit finnes ikke.'),
(153, '2017-01-01 19:24:00', '2017-01-01 19:32:03', 6, 'INFO', 'Kommunikasjon med Gunnar', 'Jeg har sendt Gunnar noen e-poster og sms''er til Gunnar Vedr. Emilie, som han aldri svarer på, og Gunnar vil heller ikke bli kontaktet PR.telefon, noe som fører til at jeg kun kan følge med via loggen i Pepilie, uten å gi tilbakemeldinger eller kunne ha direkte kommunikasjon med Emilie og Gunnar når det er vanskelige perioder. Gunnar er veldig sta og tror han kan ordne alt alene, og må gå til drastiske skritt når han skjønner at han ikke har full kontroll på situasjonen hjemme! Jeg syntes det er trist at Gunnar ikke vil samarbeide,  noe som sannsynligvis går utover alle, både Emilie , Andreas og resten av familien, og jeg syntes han bør endte sin holdning til dette! '),
(154, '2017-01-01 19:52:00', '2017-01-01 19:56:16', 5, 'INFO', 'Gjemmer mat', 'E blir bare mer og mer kreativ hva mat angår. Hun gjemmer unna, bruker lett produkter, blir sint når jeg spør, og vil lage maten selv. Det er mye vanskelig å ta tilbake kontrollen nå. Hun blir bare sur og går. Vi må vurdere rasp hvis hun ikke viser vektøkning snarlig. Jeg klare ikke å kombinere jobb og 100% oppfølging av henne'),
(155, '2017-01-01 21:21:00', '2017-01-01 21:24:01', 5, 'INFO', 'Emilie bursdag', 'Emilie sliter med å bestemme seg om hun vil feire bursdagen sin eller ei. Jeg har bedt henne om å finne ut av dette raskt, hvis ikke blir det ikke noe av.'),
(156, '2017-01-02 18:46:00', '2017-01-02 18:52:57', 6, 'INFO', 'Emilie spiser bra med mat!', 'I dag har Emilie vært hos Madli, og det gikk fint, jeg var med i deler av samtalen! Jeg syntes Emilie er flink , som møter opp og faktisk prøver å gjøre noe med situasjonen, som tydelig sliter hardt på henne. Emilie gjør faktisk, så godt hun kan og vi må bli flinkere til å rose henne! Hun trenger mer selvtillit og vi må hjelpe henne med å bygge opp denne, da nytter det ikke med sutring og klaging over at alt er sltsomt og vanskelig!'),
(157, '2017-01-08 17:53:00', '2017-01-08 17:54:41', 5, 'ACTIVITY', 'Fotball', 'E, A og jeg spilte fotball på voldsløkka i dag'),
(158, '2017-01-08 17:54:00', '2017-01-08 17:59:23', 5, 'INFO', 'Matlaging', 'Emilie lagde lunsj selv i dag og da tok hun sojakjøttboller, bønner og tomatsaus. \r\nMen sa til meg at hun spiset rundstykke.\r\nKan derfor fortsatt ikke stole på henne hva mat angår.\r\n'),
(159, '2017-01-08 18:06:00', '2017-01-08 18:08:18', 5, 'INFO', 'Måltider', 'Hun kan ikke velge måltider som ikke er på menyen. Uansett hva hun måtte selv si og mene.'),
(160, '2017-01-08 21:42:00', '2017-01-08 21:46:00', 5, 'INFO', 'Desert', 'Hun skal alltid spise desert når hun er hos deg også, sbp. Hvis ikkw vil jeg ha beskjed. Hun har en drøss med små sjokolader her som hun sier hun har fått av deg. Jeg mistenker det for å være desert som hun ikke har spist når hun har spist middag hos deg.'),
(161, '2017-01-08 21:47:00', '2017-01-08 21:48:13', 5, 'INFO', 'Siri brigitte', 'Du kan også legge inn kommentarer her. Særlig hvis det er ting rundt måltidene.'),
(162, '2017-01-08 22:16:00', '2017-01-08 22:19:49', 6, 'INFO', 'Måltider', 'Jeg har allerede lagt inn flere kommentarer her GR, og Emilie spiste også dessert i kveld, fikk ikke lagt den inn pga innloggingsproblemer . Emilie spiser veldig fort og er alltid bråsulten når hun spiser hos meg, '),
(163, '2017-01-09 21:19:00', '2017-01-09 21:20:44', 5, 'INFO', 'Måltid', 'Hvor langt tid bruker hun på middagen da?'),
(164, '2017-01-10 16:25:00', '2017-01-10 16:26:58', 5, 'INFO', 'Konfirmasjonsmøte', 'Emilie orket ikke å gå på konfirmasjonsmøte i dag. Hun var sent hjemme grunnet mye trafikk. Og ville ikke stresse bort rett etter middag. Noe som er helt greit.'),
(165, '2017-01-04 06:54:00', '2017-01-12 06:55:57', 5, 'INFO', 'Overnatting', 'E overnattet hos mamma fra onsdag til torsdag'),
(166, '2017-01-12 06:56:00', '2017-01-12 06:56:51', 5, 'INFO', 'Overnatting', 'E skal overnatte hos mamma fra torsdag til fredag'),
(167, '2017-01-12 07:06:00', '2017-01-12 07:11:16', 5, 'INFO', 'Kveldsmat', 'E lagde kveldsmat selv i går da jeg var på bandykamp. Hun tar da ansvar og lager mat til andreas også. På forespørsel sier hun at hun tar på mer smør og pålegg på brødskivene til andreas enn det hun tar på til seg selv. Så hun er veldig bevist og reflektert over sin egen situasjon. Det er ett godt tegn.'),
(168, '2017-01-15 08:13:00', '2017-01-15 08:15:58', 5, 'ACTIVITY', 'Løpetrening', 'Vi hadda 45 minutter intens løpetrening på voldsløkka. Hun drakk 1 flaske fresubin etterpå. \r\nHun spiser også mer etter en slik økt.\r\nMen dog ikke mer av fett eller kaloririk mat'),
(169, '2017-01-15 08:16:00', '2017-01-15 08:18:18', 5, 'INFO', 'Emilies tanker', 'Hun sier at hun ikke tenkte på sitte/stå/ligge fordelingen før dette ble tatt opp på sykehuset. Og de tankene har hun ikke klart å bli kvitt nå i ettertid. Noe til ettertanke.'),
(170, '2017-01-15 21:31:00', '2017-01-17 21:32:58', 5, 'ACTIVITY', 'Slalom', 'Emilie og jeg sto på slalom i wyllerløypa. Det var lite snø og isete. Men supert vær og ellers bra forhold.'),
(171, '2017-01-21 15:37:00', '2017-01-22 15:38:42', 5, 'ACTIVITY', 'Fotball', 'Emilie og jeg spilte fotball på voldsløkka.'),
(172, '2017-01-22 15:39:00', '2017-01-22 15:40:21', 5, 'ACTIVITY', 'Fotball', 'E, A og pappa spilte fotball ved movann i dag.'),
(173, '2017-01-22 23:38:00', '2017-01-22 23:40:11', 5, 'INFO', 'Emilie 15 år', 'E, A, mamma og pappa var ute og spiste middag  på resturant, Etter E sitt ønske. '),
(174, '2017-01-23 22:13:00', '2017-01-23 22:14:04', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka i dag.'),
(175, '2017-01-23 22:14:00', '2017-01-23 22:16:25', 5, 'INFO', 'Familiegruppe', 'Vi var på info møte på rasp vedrørende familiegruppe terapi. Jeg tror emilie kan ha godt av det, men hun har ikke veldig lyst.\r\nJeg skal få overtalt henne til å bli med.\r\nDet starter opp mandag 30.1.2017.'),
(176, '2017-01-23 22:16:00', '2017-01-23 22:26:48', 5, 'INFO', 'Hemligheter', 'Emilie har i lang tid båret på hemmeligheter for meg. Men i kveld ble det for mye for henne og hun måtte fortelle meg om det. Men var redd for at jeg skulle bli sint. Saken er st før veiing har hun i lang tid stått opp tidlig og drukket 2 liter vann. Det har tatt ca 45 minutter. Jeg fortalte henne hvor farlig slikt var og at hun kunne bli vannforgiftet. \r\nHun var fryktelig lei seg og savner en bestevenn veldig mye. Vidrer fortalte hun om annen små juksing med mat. Som jeg mer eller mindre var klar over. \r\nHun er nå motivert for å bli frisk og gå opp i vekt. Vi skal starte liit på nytt i morgen. \r\nAlt i alt, så dreier det seg om bedre oppfølging fra min side. Og nå må jeg skjerpe meg. Vi må også gå i familiegruppene. '),
(177, '2017-01-24 07:06:00', '2017-01-24 07:09:54', 5, 'INFO', 'Diet', 'Hun har gått kraftig ned i vekt. Dette grunnet juks ved tidligere målinger ved å drikke 2 l vann i forkant. \r\nDerfor øker vi nå fresubin mengden fra 125ml til 150 ml for alle måltider.\r\nHun sier at hun er motivert og klart for å kjempe seg ut av sykdommen. Grep må tas hvis det ikke er økning ved neste måling.\r\nBør da være ca 500g økning.\r\n'),
(178, '2017-01-24 12:17:00', '2017-01-24 12:33:02', 5, 'REPORT', 'Oppsummering uke 3', '- E fortalte at hun i lang tid har jukset ved veiing. Hun har drukket 2l vann i forkant. \r\n- Opplyst henne om faren ved vannforgiftning ved å drikke så mye vann og jeg er bekymret for hva hun ellers kan finne på.\r\n- Må skjerpe oppfølgingen, hun har atter en gang fått for mye ansvar. Jeg klarer ikke å fange opp alle triksene hennes. Det kan være farlig for henne hva sykdommen kan få henne til å gjøre.\r\n- Vi har økt fresubin fra 125 til 150 ml for hvert måltid\r\n- Vi skal bli med i familiegruppe på RASP\r\n- Hun er vedlig lei av sykdommen og virker nå mer motivert enn noen gang til å bli kvitt den\r\n- Hun er stort sett blid og fornøyd, men savner en bestevenn.\r\n- Er blitt mer avslappet til hva hun spiser, det går sakte men sikkert i riktig retning.'),
(179, '2017-01-28 05:51:00', '2017-01-28 05:52:55', 5, 'INFO', 'Sykdom', 'Andreas er syk og det går litt utover min oppfølging av emilie i from av at hun da lager flere måltider selv.\r\n'),
(180, '2017-01-30 19:18:00', '2017-01-30 19:19:14', 5, 'INFO', 'sykdom', 'Emilie følte seg kvalm på dagen og har tatt det rolig hele søndag. Hun orket ikke å spise kveldsmat og middagen var redusert.'),
(181, '2017-01-28 23:03:00', '2017-01-30 23:05:40', 5, 'ACTIVITY', 'Løpetur', 'Emilie løp en rolig tur rundt sognsvann sammen med åste. Hun spurt ikke meg, men foryslte om det etterpå. Uoppfordret\r\n'),
(182, '2017-01-31 06:26:00', '2017-01-31 06:39:55', 5, 'INFO', 'Familiegruppe, rasp', 'Uke 5 stsrtet familiegruppe på RASP. Emilie har fra første stund yttret ønske om å ikke være med. Jeg ønsker at vil skal forsøke og se om det er noe for oss. Andreas skal få slipp, da han ikke har lyst, samt at må ha fri fra skolen for å være med. Emilie viser ingen tegn til psykisk bedring og vekten har stått stolle i lang tid. Hun lyver mer bevist og holder fortsatt på i snikspise lett produkter, som hun kjøper og gjemmer i kjøleskapet. Jeg finner de alltid , etter noen dager. Emilie må følges opp mye bedre en jeg har evnet og klary så langt. Dette er en utrolig lang reise og jeg merker st kreftene begynner å ta slutt. Det er vanskelig å stole på henne også. Noe som skape konflikter.\r\nDet mor har en annen oppfatning enn meg om hva som er bra for emilie er også svært tungt. Jeg følger de fagligecrådene, men mor har ofte egen løsninger, som etter min mening taler sykdommens sak. Mor prøver til dtadighet å vri på teglene fordi hun tror emilie trenger pause eller har godt av det. Noe som er helt feil, iflg fsglige råd og min mening.Når der er slik blir det faktisk mer belastning enn til hjelp når emilie er jos henne.'),
(183, '2017-01-30 06:40:00', '2017-01-31 06:42:56', 5, 'CONFLICT', 'Familiegruppe', 'Emilie ville ikke være med på første dag.\r\nJeg ble rasende og hun gikk opp til mamma. Etter mitt ønske ble hun der til tirsdag.'),
(184, '2017-02-01 22:22:00', '2017-02-01 22:23:07', 5, 'INFO', 'Lett produkter', 'Emilie kjøper fortsatt lett produkter og gjemmer de i kjøleskapet.'),
(185, '2017-02-04 20:18:00', '2017-02-04 20:20:16', 5, 'INFO', 'Trening', 'I dag drev emilie med egentrening hjemme.\r\n20 spensthopp, 20 pushups og 2 min planken. Hun rakk kun en rude før jeg kom hjem. Hun sier at hun er sulteforet på trening'),
(186, '2017-02-04 20:20:00', '2017-02-04 20:21:04', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka.'),
(187, '2017-02-12 17:00:00', '2017-02-12 17:01:35', 5, 'ACTIVITY', 'Skitur', 'E og mamma gikk til ullevålseter på ski.'),
(188, '2017-02-11 17:01:00', '2017-02-12 17:03:17', 5, 'ACTIVITY', 'Trening', 'E var ute og trente på voldsløkka på egenhånd. Hun fulgt ett program som jeg har gitt henne. Varighet ca 50 min.'),
(189, '2017-02-10 17:03:00', '2017-02-12 17:04:53', 5, 'ACTIVITY', 'Slalom', 'E og jeg hadde en 2 timers kveldstur på slalom i tryvannskleiva. Bra forhold.'),
(190, '2017-02-14 20:13:00', '2017-02-14 20:16:48', 5, 'INFO', 'Lyver', 'E sinkkjøper og spiser fortsatt lett produkter. Og når jeg avslører henne lyver hun til meg og blir stadig mer utspekulert i sine forklaringer. Hun trenger mye bedre oppfølging. Det er ikke mulig å kombinere 100% arbeide med tett oppfølging.'),
(191, '2017-02-18 05:29:00', '2017-02-18 05:33:46', 5, 'REPORT', 'Oppsummering uke 8', '- Bra vektøkning\r\n- ingen konflikter\r\n- Godt humør\r\n- Lekt lite med venner\r\n- Snikspiser fortsatt lett produkter\r\n- Har ikke overnattet hos mamma\r\n'),
(193, '2017-02-19 07:32:00', '2017-02-20 07:32:59', 5, 'ACTIVITY', 'Skitur', 'Skitur med mamma'),
(194, '2017-02-18 07:33:00', '2017-02-20 07:34:04', 5, 'ACTIVITY', 'Fotball', 'E, A og jeg spilte fotball på voldsløkka'),
(195, '2017-02-20 07:37:00', '2017-02-20 07:43:36', 5, 'INFO', 'Spising', 'I det soste har det blitt slurv hva både inntak av fresubin og dessert angår.\r\nHvis jeg ikke passer på, så glemmer hun det. Og jeg må be henne mange ganger.\r\nRutinene rundt måltidene har også sklidd litt ut. Det som er bra er at hun generelt spiser bra og vekten øker på trass av dette.\r\nHun er mye i kontakt med mat og det må også begrenses. Hun spiser mye frukt utenom måltidene. Hun er ikke opptatt av når hun spiser og spiser når hun er sulten.\r\nHun pleier også å spise mer etter en aktivitet. Men hun må følges opp nøye, ellers går det ikke veien.'),
(196, '2017-02-21 16:29:00', '2017-02-25 12:09:38', 5, 'INFO', 'Vinterferie, trysil', 'Denne uken er vi i trysil på vinterferie fra mandag til torsdag. Emilie skal følge måltidene som normalt, men vi har økt fresubin fra 150 til 200ml for hvert måltid.\r\nDette for å kompansere for økt aktivitet i form av slalom. Til middag på mandag spise emilie dessert som bare det, is, kake og frukt. Hun storkoste seg og forsynte seg med dessert hele 3 ganger. Akkurat slik som hun ville ha gjort før sykdommen. Det var godt å se. I dag, tirsdag har vi stått på slalom fra 1030 til 1615.\r\n\r\nBaksiden er at jeg er veldig usikker på utbyttet av en slik aktiv ferie, hun blir vedlig fokusert på aktivitet og ser ut til å bruke alt hun har av krefter.\r\nDet positive er at hun da blir veldig sulten og spiser bra i  etterkant.\r\nMen jeg må passe godt på, for hun prøver å lure seg unna selv når vi har hatt masse aktivitet. Andreas sier at hun jukset ved drikking av fresubin. Hvor hun tok opp en tom fresubin flaske fra søppla og kastet den fulle flasken. Slikt at jeg trodde at hun hadde drukket opp. Igjen, hun krever 100% oppfølging under måltidene. Og hun finner stadig ny måter å snike unna mat på.'),
(197, '2017-02-21 16:50:00', '2017-02-21 16:51:42', 5, 'ACTIVITY', 'Slalom', 'Trysil, slalom fra 1030 - 1615'),
(198, '2017-02-23 01:47:00', '2017-02-23 01:48:43', 5, 'ACTIVITY', 'Slalom', 'Trysil, slalom fra 1030 - 1630'),
(199, '2017-02-24 19:27:00', '2017-02-24 19:32:00', 5, 'INFO', 'Lurer unna mat', 'Hun driver forsatt å lurer inna mat, heller ut litt av fresubinen, kaster brødskiver, spiser ikke dessert. Hun finner på stadig nye metoder for å lure unna mat og hun benekter for å ha gjort det når jeg spør. Det blir bare vanskeligere å stole på hun. Hun må følges opp bedre. Har påpekt det mang en gang, men jeg sliter med dette. Jeg ænsker at hun legges onn på rasp.'),
(201, '2017-03-02 22:22:00', '2017-04-10 16:10:07', 5, 'INFO', 'Samvær', 'Overnattet hos mamma fra tors til fredag'),
(202, '2017-03-04 22:25:00', '2017-03-04 22:27:03', 5, 'ACTIVITY', 'Løping', 'Vi løpe på mølle. Først 3 km rolig og så 3 km full fart. Hun løp da på 11.03. Og det er veldig bra. Hun drakk yt rett etterpå. Og til kvelds har hun spist veldig bra.'),
(203, '2017-03-05 21:54:00', '2017-03-05 21:54:58', 5, 'ACTIVITY', 'Skitur', 'Skitur med mamma til ullevålseter'),
(204, '2017-03-01 21:55:00', '2017-03-05 21:56:25', 5, 'INFO', 'Familiterapi, RASP', '0930 - 1600, mamma og emilie var på rasp'),
(205, '2017-03-02 21:56:00', '2017-03-05 21:57:17', 5, 'INFO', 'Familiterapi, RASP', '0930 - 1600 mamma og emilie var på rasp'),
(207, '2017-03-02 21:58:00', '2017-03-05 21:59:13', 5, 'INFO', 'Blodprøve', 'E tok blodprøve på ullevål, anvisning fra bup'),
(208, '2017-03-06 21:51:00', '2017-03-06 21:54:18', 5, 'INFO', 'Tvangstanker', 'Det virker som om tvangstankene har sluppet litt taket. Hun dtover ikke lenger mrd å rydde sko og line opp skolissene i gangen. Ei ser jeg st nye rutiner har dukket opp. Ei er hun så nøye på når og hva hun spiser. Tar nå også en youghurt i ny og ne.\r\nHun er stort sett blid og fornøyed. '),
(209, '2017-03-08 19:43:00', '2017-03-08 19:54:40', 5, 'INFO', 'Venner', 'Emilie var veldig lei seg i dag og da kom det frem at hun savnet venner, særlig en bestevenn. Hun føler at alle overser henne.\r\nHun savner noen å snakke med, som kan lytte og forstå henne. Noe verken pappa eller mamma er flinke til. Hun dynes heller ikke maly på bup er flink på det. Hun vil gå i terapi, men da alene. \r\n\r\nHun utrykker også misnøye over kroppen sin og sier hun vil være som før, da hun var syltynn.\r\nVi snakket litt sammen og så kom det gode humøret hennes raskt tilbake.'),
(210, '2017-03-08 19:49:00', '2017-03-08 19:51:55', 5, 'INFO', 'Vektøkning', 'Vi er inne i en tung periode hvor hun går ned i vekt. I løpet av siste 6 mnd har hun gått opp 1 kg. Vi kommer ikke videre og jeg vil atter en gang be bup om å søke plass på rasp. Mat og oppfølging er det eneste som hjelper. Jeg kan ikke se noen form for effekt av terapien'),
(213, '2016-10-17 17:07:00', '2017-03-11 18:23:41', 5, 'INFO', 'Emilie brev', 'Jeg hadde de lett-produktene fordi jeg synes hvitost og leverpostei er littgrann vanskelig å spise av og til, og da har jeg de der i tilfelle.\r\njeg har nesten ikke brukt de, men de få gangene jeg har brukt de er når jeg har spist mat som er i tillegg til kostplanen.\r\nHvis jeg for eksempel har spist en brødskive ekstra så har jeg brukt lett-produkter noen få gangerfordi da får jeg minsst mulig ekstra, hvis du skjønner.\r\nMen hvis jeg skal ha en brødskive me leverpostei, og den børdskiva er en del av kostplanen, så er det egentlig ikke noe problem for da er det en del av kostplanen.\r\nOg så har jeg en sånn tanke inni hodet mitt som er sånn:\r\nHvis jeg ikke smaker forskjell på lett hvitost og vanlig hvitost, da kan jeg like godt spise lett hvitost, så sparer jeg meg for de ekstra kaloriene.\r\nMen som sagt, så er det kun når jeg spist brødskiver som er i tillegg til  kostplanen at jeg har brukt lett-påleggene.\r\n\r\nOg det er ikke hver gang jeg har spist brødskiver som har kommet i tillegg til kostplanen med lett-pålegg. Jeg har også spist vanlig leverpostei mange ganger. Flest ganger.\r\nDet har bare vært 1-2 ganger hvor jeg har brukt de lett-produktene. Men de lett-produktene hadde jeg liksom en utvei hvis det ble vanskelig å spise en ekstra brødskive med vanlig hvitost, og jeg tenkte at det er bedre å spise mager leverpostei da, enn skinke, som jeg da ville endt opp med, som er enda magrere.\r\nAt litt var bedre enn ingenting. For jeg seirer over meg selv da og, bare ikke i like stor grad. Jeg har bare prøvd å gjøre sånn at jeg ikke skal spise skinke hele tiden, for det er jo det jeg spiser mest av.\r\n\r\nEn annen ting, vi skal ha musikk prøve i morgen, kan jeg få karakter på den? Jeg føler at jeg ligger godt ann og har øvd mye.');
INSERT INTO `event_log` (`id`, `created_date_time`, `last_modified_date_time`, `fk_user_id`, `level`, `title`, `content`) VALUES
(214, '2016-11-07 18:27:00', '2017-03-11 18:49:34', 5, 'INFO', 'Emilie brev', 'jeg skjønner hvis du kanskje er lei av å drive å måle op fresubin og musli og sånt til meg, men jeg synes ikek du skal slutte med det enda.\r\nJeg kjenner at det er for tidlig. jeg blir usikker på om det er nok eller for mye, og gjøre mine egene vurderinger.\r\nJeg liker å ha det på det trygge enda. Det begynte å bobble litt inni meg når jeg fikk havregrøten som ikke var målt opp i dag morres.\r\nNår jeg målt opp vet jeg at det er det jag skal ha og det er trygt og jeg er vant til det.\r\nHvis jeg får fresubin og den ikke er målt opp får jeg en sånn uro inni meg, og det kan hende jeg heller ut litt.\r\nDet er større sannsynlighet for at jeg finner på noe/tar vekk noe hvis jeg får det og det ikke er målt opp.\r\nDet er det samme som at du ikke ville løpe med meg på lørdag, fordi jeg ikek hadde veid meg.\r\nDu blir da urolig og stressa inni deg for du ikek vet hva jeg veier, og vil ikke ta noen sjanse.\r\nSamme er det med meg. jeg blir urolig og stressa og oppgitt når jeg vet at det ikke er målt opp og \r\njeg ikke vet i det hele tatt om det er for lite eller for mye.\r\nSå da kan jeg fjerne litt av maten, bare for å være på den sikre siden. \r\nFor det er bitte litt bedre å få i seg litt for lite enn litt for mye.\r\nSånn tenker jeg. Jeg vet at det ikke stemmer, men sånn tenker sykdommen min.\r\nOg vi har faktisk kommet oss videre, for før veide du poteter/ris/pasta, du veide fisken og sånn. \r\nMen det har vi slutta med og det takler jeg fint.\r\nMen jeg er ikke helt der enda at jeg takler at du ikke måler fresubin/musli/grøt, og det du veier nå enda.\r\nI tillegg kan det også letter oppstå problemer når du skal veie meg fordi jeg vet ikke om jeg spiste nok.\r\n'),
(215, '2016-12-05 18:49:00', '2017-03-11 18:50:15', 5, 'INFO', 'Emilie brev', 'Kan jeg være så snill og få slippe å veie meg i morgen tidlig? Vi skal ha nynorsktentamen, og jeg er litt redd for at veiinga skal gå utover den. Hvis du vil veie med i morgen så kan jeg gjøre det senere dagen. Jeg har nesten ikke noe aktivitet lenger, og det eneste jeg hadda av aktivitet forrige uke var den forballen vi spilte på søndag. Det er så deilig de ukene jeg slipper å veie meg. Og det hadde vært veldig fint å slippe det denne uka. Jeg har så mye annet å tenke på (tysktentamen,juleavsluttning,band-prosjekt og nynorsken). det stresser med ikke, men jeg hadde blitt veldig takknemlig om jeg fikk slippe å veie meg eller i hvert fall ta den sener på dagen i morgen så jeg slipper og gå og ha den vekta i tankene på nynorsken. Jeg blir så deprimert av og veie meg, fordi eg vet at jeg kommer til å få en negativ følelse inni meg uansett hva pila står på. Jeg trenger også frihet fra meg selv noen ganger, og den beste måten jeg får det på er å slippe veiing. Hvor ofte ber jeg liksom om det? Jeg har veid meg hver uke i ett år nå snart.'),
(216, '2016-08-16 17:50:00', '2017-03-11 18:52:15', 5, 'INFO', 'Emilie brev', 'Det er ikke bare å stille meg ett spørsmål og så får du ett konkret svar på det. Selvom det er jeg som vet best har jeg ikke svar på alt jeg heller. Noen ting bare gjør jeg, det er som når noen spør om noe og så kan du svaret selvom du egentlig ikke viste at du kunne det og at du hadde lært det. Sånn er det litt med meg og, jeg bare gjør det, kanskje det var fordi jeg syntes det var for mye peanøttsmør på på elelr at brødskive var for tykk. Men hvis jeg gjemmer noe på grunn av det en gang, er det ikke dermed sagt at jeg gjør det en annen gang og. Og hvis jeg synes brødskiva var for tykk og gjemmer den, så dropper jeg ikke å spise den for da tar jeg kanskje mer fresubin eller en ny brødskive eller nøtter, i stedenfor. Men det betyr heller ikke at hvis jeg spiser mye en da så er det fordi jeg har gjemt noe. Det er flere ganger hvor jeg faktisk bare spiser all den maten, enn de gangene jeg har gjport noe lureri. Og grunnen til at jeg bare ikke sier at jeg er mett i stendefor å gjemme unna vet jeg egentlig ikke, men hvis det var en situasjon hvor det var sånn at jeg ikek ville ha en brødskive fordi jeg hadd tatt på for mye peanøttsmør så føles det feil og si at jeg ikke orket den. Så da lurer jeg den unna. men jeg har greid å si noen ganger, at jeg er mett, eller sagt at jeg ikke orket mer. Men en annen grunn jeg tror kan være en årsak til at jeg ikke sier at jeg er mett i stendefor og gjemme er fordi hvis jeg bruker den unnskyldningen for mye gidder du ikek å høre på meg til slutt. For da tror du kanskje bare at det er for å komme unna noe på en enkel måte, og at jeg kanskje egentlig ikke er mett, men bruker det som en unnskyldning.'),
(217, '2016-09-19 19:41:00', '2017-03-11 20:45:47', 5, 'INFO', 'Emilie brev', 'Det var til lunsjen jeg syens det ble for mye smør på brødskivene så jeg la de der og tok to nye.\r\nJeg kjente inni meg at det begynte å bobble litt, og siden jeg hadde spist brødskiver til frokost med smør og peanøttsmør da og.\r\nJeg bare gjorde det uten å tenke.\r\nJeg vil egentlig ikke snakke om det, jeg syens det er flaut, og jeg blir ukomfortabel.'),
(218, '2016-08-19 19:46:00', '2017-03-11 20:56:01', 5, 'INFO', 'Emilie brev', 'Det var litt vanskelig å drikke juicen i dag siden det var en ny juice og jeg trodde jeg kunne klare å drikke den, men inni meg var det noe som\r\nbegynte å boble på en måte (på samme måte som når jeg blri rastløs og ikke klare å sitte i ro) og da føles det som  om jeg kommer til å bli gærn\r\nhvis jeg drikker mer, for noe inni meg sier at det ikke er greit å drikke/spise. \r\nHvis jeg hadde drukket vet jeg ikke hva som hadde skjedd.\r\nDet var noe inni meg som ikke taklet å drikke det. \r\nJeg synes det er rart, men det er litt på samme måte som når du smaker på noe,\r\nså liker du det ikke. Da klarer man ikke å spise mer, hvis du virkelig ikke liker det.\r\nOg det er sånn jeg også får det, bare at det ikke er fordi jeg ikke liker det at jeg får en sånn sperre. \r\nDet er fordi noe inni meg ikke liker det.'),
(219, '2017-03-11 23:48:00', '2017-03-12 22:49:10', 5, 'INFO', 'Jukset', 'Gjemte unna 2 brødskiver til kveldsmaten. Spist masse frukt i stedenfor.'),
(220, '2017-03-16 20:58:00', '2017-03-16 20:59:13', 4, 'INFO', '', 'Jeg ligger på gulvet på badet og har skrekkelige mageknipe. Jeg vrir og vender på meg for å finne en behagelig stilling. Ingenting funker. Jeg er så mett at jeg ikke klarer å gjøre en bevegelse uten at det gjør vondt i magen. På rundt 3 timer har jeg spist følgende:\r\n-2 brødskiver\r\n-2 lomper med pålegg\r\n-3 yoghurter\r\n-et eple, bringebær, blåbær og jordbær\r\n- 1 glass melk\r\n-1 glass fresubin\r\n-1 skål frokostblanding med 2 dl melk\r\n\r\nJeg klarte ikke å stoppe før denne skrekkelige mageknipen plutselig inntok magen min. Jeg har diagnosen anoreksi, men jeg er overbevist om at jeg har overspisingslidelse i tillegg. Er det mulig? Å ha både anoreksi og overspisingslidelse samtidig? Jeg har en rar følelse inni meg, som jeg ikke kan beskrive. Jeg savner på en måte å være sulten. Jeg spiser ikke etter sulten. Jeg spiser etter kostplanen. Jeg spiser det jeg skal og gjerne litt til selv om jeg er mett. Og jeg overspiser alltid til kveldsmat. Det er bare kveldsmaten jeg overspiser til, men det er forferdelig. Det er som om anoreksien går ut, og en annen sykdom kommer inn. Jeg har ikke kontrollen uansett, men det er nesten værre sånn jeg har det om kvelden. Jeg føler meg skitten. Jeg føler meg ikke som et menneske. Jeg føler meg uvanlig og det eneste jeg vil er å være vanlig. Spise når jeg er sulten. Klare å legge fra meg Maten selv om jeg er mett. Ikke miste kontrollen. Men jeg er redd for at hvis anoreksien forsvinner mister jeg det eneste jeg har som holder meg tilbake. Det eneste som gjør at jeg hvertfall er litt undervektig. Det eneste som klarer å kontrollere maten. For jeg føler at jeg ikke klarer det, og hvis jeg blir frisk fra anoreksien, kommer jeg da til å overspise hele tiden? Kommer jeg til å bli overvektig? Jeg vil være sånn jeg er nå. Jeg vil ha muskler. Jeg vil være kjempesterk og klare alt. Jeg vil være best. Og hvis jeg er vanlig og normal, kan jeg da være best? Hvis jeg er normal er jeg ikke unik. Da er det ikke noe spesielt ved meg å legge merke til. Da vil ingen misunne meg. Ingen misunner feite folk. Alle ser opp til de tynne. De tjukke er de mislykka. Og jeg vil ikke være mislykka. Jeg vil føle sulten. Jeg liker å være sulten. Jeg vil heller være sulten enn stappmett.'),
(221, '2017-03-18 23:05:00', '2017-03-18 23:07:28', 5, 'ACTIVITY', 'Løping', 'E ville ikke være med a og meg å spille fotball på voldsløkka. Hun løp en runde rundt voldsløkka uten å si i fra til meg. Hun drakk ennut og 150ml fresubin etterpå.'),
(222, '2017-03-22 20:49:00', '2017-03-22 20:50:03', 5, 'INFO', 'Sykklet', 'Emilie sykklet til skolen i dag. Drikker da en flaske fresibin 200 ml'),
(223, '2017-03-19 20:50:00', '2017-03-22 20:50:57', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte litt fotball på voldsløkka'),
(224, '2017-03-17 20:51:00', '2017-03-22 20:52:16', 5, 'INFO', 'Bursdag', 'E var i bursdagen til marte. Men hun kom tidlig hjem fordi hun var sliten, sa hun.'),
(225, '2017-03-29 20:21:00', '2017-03-29 20:24:25', 5, 'INFO', 'Oppfølging', 'Jeg skal nå lage middag hver dag. Emilie skal ikke lenger gjøre det selv.\r\nMamma må også skjerpe seg og ikke la hun lage middag selv. Emilie sier hun ønsker bedre oppfølging på nrttipp dette.\r\n'),
(226, '2017-03-31 04:25:00', '2017-03-31 04:25:50', 5, 'INFO', 'Epost til sbp', 'Du skal lage all mat, du bestemmer. Ikke Emilie. Du kan ikke stole på henne når det gjelder mat. Vi har aldri svin og aldri stekt den i ovn. Da er det stekepanne med smør.\r\nDerfor drar hun til deg når hun har lyst på svin, samme med biff.\r\n\r\nDerfor vil hun ikke spise faste dager hos deg, fordi hun drar opp når basert på hva hun ønsker til middag. \r\nMen nå bestemmer jeg dette.\r\n- Middag hos deg hver mandag.\r\n- Fast overnatting fra torsdag til fredag.\r\n- ut over dette kan hun velge flere måltider og overnattinger selv.\r\n\r\nJeg har følger nå måltidene mye bedre oppsom har resultert i at hun blir fort sur og sint.\r\nSå hun har nok hatt alt for frie tøyler.\r\n'),
(227, '2017-04-01 07:22:00', '2017-04-01 07:25:32', 5, 'INFO', 'Måltider', 'Til middag i går hadde hun problemer med å drikke juicen, dette er helt nytt.\r\nHun mente jeg hadde helt i for mye, men det var ikke tilfelle.\r\nHun heller litt ut og gjemmer unna i en annen kopp. Hun drakk den opp til slutt.\r\n'),
(228, '2017-04-02 22:06:00', '2017-04-02 22:10:16', 5, 'INFO', 'Mat', 'Hun finner stadig på nye triks for å lure seg unna små ting, slik som smør på brødskivene. Der kan hun bytte ut de som er påsmøret med nye uten smør hvis jeg er uoppmerksom. Hun blir fort irritert hvis jeg følger nøye med. Hun kan også være kenge på do. Så lenge at jeg blir mistenksom på hva hun driver med. '),
(229, '2017-04-03 16:51:00', '2017-04-03 16:52:55', 6, 'REPORT', '', 'Emilie drakk i fresubin etter middag, jeg glemte å servere henne denne.. '),
(230, '2017-04-04 04:59:00', '2017-04-04 05:04:08', 5, 'INFO', 'Bup', 'Har bedte madli avslutte sitt engasjemang i saken. Dette da hun nå ikke lenger ser emilies beste. Hun har begynt å oppføre seg som sbp sin psykolog og forsvarer.\r\nHun krotiserer også meg og mine beslutninger. Hun har hele tiden trenert mitt ænske om å få emilie inn på rasp. Dette på trass av at emilie kun har gått opp 1 kg siden september 2016.'),
(231, '2017-04-07 03:06:00', '2017-04-10 16:09:35', 5, 'INFO', 'Samvær', 'E overnattet hos mamma fra torsdag til fredag'),
(232, '2017-04-07 03:07:00', '2017-04-07 03:08:27', 5, 'INFO', 'RASP', 'Familieterapi, E og mamma'),
(233, '2017-04-08 03:08:00', '2017-04-07 03:09:37', 5, 'INFO', 'RASP', 'Familieterapi, E, mamma og pappa'),
(234, '2017-04-07 21:25:00', '2017-04-07 21:26:18', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka'),
(235, '2017-04-09 07:38:00', '2017-04-09 07:40:48', 5, 'INFO', 'Godteri', 'Det er lenge siden jeg har sett emilie forsyne seg så bra av lørdagsgotteriet.\r\nHun satt og så på film og gomlet litt hele tiden. Noe som er ett godt tegn.'),
(236, '2017-04-12 16:41:00', '2017-04-13 09:23:35', 5, 'INFO', 'Oppfølging', 'Når jeg nå har begynt å følge opp måltidene bedre blir hun fort sur og kværulerende. \r\nHun det liker dårlig og føler nok at hun da mister kontrollen. Hun har hatt for fri tøyler hva måltidene angår. '),
(238, '2017-04-12 04:00:00', '2017-04-13 09:40:43', 5, 'CONFLICT', 'Konflikt i forbindelse med Middag', 'Hun ville plutselig ikke drikke juicen eller fresubinen. Hun gikk bare inn på rommet sitt. Hun var trist og lei seg. Etter å ha snakket litt sammen, kom humøret tilbake og hun fullførte middagen etterpå.\r\nMerker at sykdommen fortsatt styrer mye av hennes valg, men den er ikke så strek og e klare å overstyre sykdommen. Hun har heller ikke så streke utbrud. Hun gråter og blir lei seg. Men kommer relativt rask til hektene igjen bare ved å snakke med henne.'),
(239, '2017-04-14 19:59:00', '2017-04-14 20:00:40', 5, 'ACTIVITY', 'Fotball', 'A,E og jeg har spilt fotball på voldsløkka.\r\nBare E og jeg har også sentret litt på voldsløkka'),
(240, '2017-04-13 20:02:00', '2017-04-14 20:04:39', 5, 'ACTIVITY', 'Løping', 'E toke en liten løpetur uten å spørre neg. Fikk lirket det ut av henne når hun kom hjem. Ba henne da drikke en styrk sjokolademelk som vi hadde kjøleskapet 33 ml.'),
(241, '2017-04-13 20:04:00', '2017-04-14 20:05:47', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte litt fotball i ballbingen på voldsløkka'),
(242, '2017-04-15 17:09:00', '2017-04-15 17:10:51', 5, 'ACTIVITY', 'Løping', 'Emilie fikk lov til å trene på egenhånd på voldsløkka. Hun fulgt ett interval prgram jeg ga henne.'),
(243, '2017-04-15 21:24:00', '2017-04-15 21:57:37', 5, 'CONFLICT', 'Hos mamma', 'Emilie har spist lunsj og middag hos mamma i dag og som vanlig  blir det da problemer når jeg skal sjekke at måltidene har gått ihht diet planen.  Denne gangen var det fresubin som ikke var blitt tatt. SBP informerte meg riktignok om dette pr epost.\r\nI ettertid kom det også frem at sbp ikke engang vet hviklen mengde fresubin hun skal ha. Dette på trass av at det dtår tydelig på diet planen her. Klsrt st ting blir vanskelig da. Emilie ble fryktelig sint på ned i kveld og ville til mamma. Dette mye grunnet manglende måltider tidligere i dag.\r\nSom jeg da må følge opp i etterkant og det skaper fort konflikt. I kveld fikk hun ett tildels kraftig utbrudd, smalt med døren og skjelte meg ut. Hun synes jeg er en dritt som bare tenker på meg selv. Hun er redd for at jeg skal bli sint og slå henne. Føler at jeg var kontrollet i kveld, men ba henne om gå slik som hun holdt på. Til slutt kjørte jeg henne opp til mamma.\r\nAndreas kom da ned hit fordi e lagde mye bråk hos mamma også. Hun var sint fordi mamma ikke følger opp måltidene.'),
(244, '2017-04-16 14:48:00', '2017-04-16 14:58:14', 6, 'INFO', 'Fresubin', 'Emilie har drukket riktig mengde fresubin i dag, og jeg målte opp 175 Ml i går ,som jo er 25 Ml for mye, men dette er selvsagt ikke problemet for Emilie,at hun skal få for mye næring. Emilie og jeg har gått en lang tur i dag og sa ,før hun dro fra meg i dag ,at hun lovet å kompensere med mer mat/drikke når hun kommer til pappa ca. kl,.1545.i dag, 1.påskedag. Det er ikke noe poeng å lage et drama pga.at jeg ikke serverte fresubin etter lunsj i går, det viktigste er at Emilie totalt sett i løpet av dagen får nok næring til å kunne gå opp i vekt , man må også passe på å gi noe ekstra etter trening/ tur .o.l.'),
(245, '2017-04-16 16:13:00', '2017-04-16 16:14:15', 5, 'INFO', 'Samvær', 'E overnatter hos mamma fra lørdag til søndag'),
(246, '2017-04-16 04:00:00', '2017-04-16 20:41:51', 5, 'CONFLICT', 'Konflikt i forbindelse med Kveldsmat', 'Ble problemer da jeg sa at jeg skulle lage maten. Det likte hun dårlig og byttet ut brødskivene med smør.  Vi ble enige til slutt og hun fullførte måltidet. Ingen tvil om st vi må ta tilbake kontrollen over alle måltidene.\r\nOg følge dietplanen til punkt og prikke. Det nytter ikke å glemme eller se me&#314;lom fingrene med ting. Kampen må tas til hvert måltid.'),
(247, '2017-04-16 21:13:00', '2017-04-16 21:21:34', 5, 'INFO', 'aktivitet', 'Ved aktivteter som krever ekstra inntak av næring skal dette avtale på forhånd. Det er helt håpløst å skyve ansvart for dette over på Emilie i etterkant av aktivteten. Da har du ikke skjønt vedlig mye hva sykdommen handler om. Og, diet planen skal følges, dvs. ikke for mye eller for lite mat, men det som står på planen.\r\nSkal Emilie bli frisk så må oppfølgingen være 100%, og den jobben må gjøres uansett om det er påskedag eller ei. Kan dettte være så vanskleig å forstå da,\r\nDet å skyve alltid skyve problemene og utfordringene over på meg, gjør at Emilie aldri vil verken får troen eller respekt for deg. Du må også evne å ta de rette valgene for henne. \r\nLite tyder på at det vil gange emilie å utvide ditt samvære med henne slik situasjonen er pr. dags dato.'),
(248, '2017-04-17 16:01:00', '2017-04-17 16:01:52', 5, 'ACTIVITY', 'Fotball', 'E og jeg har spilt fotball i maridalen'),
(249, '2017-04-18 04:04:00', '2017-04-19 04:05:15', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball i ballbingen på voldsløkka'),
(250, '2017-04-19 19:12:00', '2017-04-19 20:23:07', 5, 'INFO', 'Terapi', 'Vil kontakte en privat terapaut og høre hva slags opplegg de kan tilby emilie. Dette da jeg ikke lenger tror bup har god nok kompetanse på spiseforstyrrelse. Dette basert på ett års erfaring med bup.\r\nSkal emilie gå til en privat terapuat må vi ha en henvisning fra fastlegen. Og jeg har lyst til å finne en ny fastlege til emilie. Grunnet nåværende fastlege utviste dårlig kompetanse når jeg søkte råd vedrørende emilies vekttap. Har tidligere spurt sbp om emilie kan flyttes til hennes fastlege, men det var hun negativ til. Må se hva jeg kan få til. Og må finne ut av dette fort.\r\nDet er viktig å forstå at terapi i deg selv løser ingenting. Det er vektøkning og oppfølging rundt måltidene som er det viktigste. Reglen er at de må opp i normal bmi før de er mottakelige for terapi. E veier nå 46.9 og må opp i 52 kg for å nå normal bmi. Så den kampen må vi ta selv og påse at dietplanen følges, uansett og det skaper konflikter. Konflikter o deg selv har sin verdi i form at hun da må utfordre sine grenser. Er det aldri konflikter betyr det at hun hele tiden er i din komfortsone, noe som kan være en indikator på at progresjonen uteblir. Husk hun vil helset være der hun er nå.'),
(251, '2017-04-20 16:41:00', '2017-04-20 16:51:48', 6, 'INFO', 'Emilie ', 'Emilie og Andreas spiste middag hos meg i dag, og Emilie har som vanlig svært dårlig tid når hun skal ha middag, og lar meg ikke lage middagen. Hun vil heller ikke ha dessert. \r\n\r\nVedr. bytte av fastlege må man også tenke praktisk, dessuten kan Emilie få henvisning fra Bente, som er lege på Bup, dette kan jeg ordne med. \r\n\r\nEmilie valgte å dra ned til pappa/ Gunnar i kveld, siden hun har naturfagbok hos han og har prøve i dette faget i morgen , Emilie syntes også at jeg lufter for mye og at dette blir et problem når hun er hos meg...\r\n\r\nNB: Gunnar: Gi meg beskjed , dersom jeg skal kontakte Bup/lege for henvisning til Klinikken på Fornebu. '),
(252, '2017-04-21 03:23:00', '2017-04-21 03:26:17', 5, 'INFO', 'Andreas', 'Andreas samvær mamma:\r\nMan tirs, ons, torsdag uke 15\r\nMan, tirs, ons, torsdag uke 16'),
(253, '2017-04-21 03:45:00', '2017-04-21 03:49:12', 5, 'INFO', 'Elstra tiltak', 'Skal kontakte Villa Sult og høre med dem.\r\nMulig vi ikke trenger henvisning.\r\nSe her <a href="http://spiseforstyrrelser.no/">VillaSult</a>'),
(254, '2017-04-22 16:34:00', '2017-04-22 16:35:24', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball i ballbingen på voldsløkka'),
(255, '2017-04-23 20:01:00', '2017-04-23 20:02:45', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball og tennis på voldsløkka'),
(256, '2017-04-22 20:08:00', '2017-04-23 20:10:16', 5, 'INFO', 'Lørdags gotteri', 'E spiste og koste seg med lørdags gotterietvsitt på lørdag. Hun drakk også en cola no sougar og det skjer ikke ofte.'),
(257, '2017-04-24 04:00:00', '2017-04-24 06:36:41', 5, 'CONFLICT', 'Konflikt i forbindelse med Frokost', 'Hun nekter å spise avtalt menge frokostblanding og prøvde å jukse med mengden. Ikke vil gå til bup heller og alt er nå meget vanskelig. Dette viser bare hvor godt sykdommen fortsatt sitter i henne.\r\n'),
(258, '2017-04-26 21:03:00', '2017-04-26 21:09:21', 5, 'INFO', 'Problemer', 'Emilie vender tilbake til gamle synder igjen og lurer unna litt mat . Hun sliter nå fælt med vekten og liker ikke tanken på å gå opp i vekt. Hun blir fort sur og sint når jeg tar full kontroll over måltidene. Hun lyver også om hva hun har spist når jeg spør.'),
(259, '2017-04-28 03:30:00', '2017-04-29 03:31:54', 5, 'INFO', 'Savær', 'E overnatter hos mamma fra torsdag til fredag'),
(260, '2017-04-29 13:46:00', '2017-04-29 13:47:58', 5, 'ACTIVITY', 'Løpetur', 'E løp rundt Sognsvann alene. Hun brukte 12:55. Hun drakk så 0.5 l Styrk rett ned etterpå.'),
(261, '2017-04-29 13:48:00', '2017-04-29 13:49:11', 5, 'ACTIVITY', 'Fotball', 'A, E og jeg var å spilte fotball i maridalen. E tok det svært rolig.'),
(262, '2017-04-30 20:24:00', '2017-04-30 20:26:02', 6, 'INFO', 'Nye blodprøver i begynnelsen av mai', 'Legen ved BUP (Bente) anbefalte ny blodprøve i uken som kommer.'),
(263, '2017-04-30 04:00:00', '2017-04-30 20:43:49', 5, 'CONFLICT', 'Konflikt i forbindelse med Kveldsmat', 'Det ble problematisk å ha smør på brødskivene. Hun prøvde å bytte de ut. \r\nEtter mye krangling med neg gikk det bra til slutt. Hun ville til og med ha mer mat og valgte de litt frokostblanding'),
(264, '2017-04-30 20:44:00', '2017-04-30 20:45:10', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka. Hun drakk en yt etterpå.'),
(265, '2017-04-30 20:45:00', '2017-04-30 20:49:23', 5, 'INFO', 'VillaSult', 'På onsdag skal vi til VillaSult mellom 0900 og 1100. Det er kun ett info møte, så får vi se hva de kan bidra med. Velger vi en privat klinikk må bup droppes. '),
(266, '2017-05-01 08:57:00', '2017-05-01 09:02:16', 5, 'INFO', 'Regler', 'Jeg hsr strammet inn og følger nå opp måltidene mye tettere. Noe som fører til flere konflikter. Emilie er lei av meg og søker da mer samvær med mamma. Dette slik at hun kan omgås reglene mine. Hun beskylder meg også for mye rart. Uansett, jeg er trygg på de valg jeg gjør og det handler om å ha nok krefter til å følge henne opp. '),
(267, '2017-05-01 09:15:00', '2017-05-01 09:20:48', 5, 'INFO', 'Sommerferie 2017', 'Jeg har ingen planer for sommerferien og ønsker at emilie skal veie rundt 50 kg før vi legger ut på noen ferie reiser. Hun sliter nå og mange av de gamle problemene rundt måltidene har dukket opp igjen. Det å holde vekten under reise har vi ikke klart tidligere. Og sykdommen og problemene følgers oss uansett hvor vi er. Så ferie blir det ikke uansett. Det blir bare nye omgivelser og samme utfordringer.'),
(268, '2017-05-01 09:56:00', '2017-05-01 10:13:04', 6, 'INFO', 'Emilie og vektoppgang', 'Som vanlig vil ikke Gunnar høre på råd fra fagfolk og andre, som har god innsikt i sykdommen (Anorexi) og tror han klarer å hjelpe Emilie på egenhånd, men saken er at Emilie ikke har gått  opp i vekt pp 6 -8 måneder og vi må ha profesjonell hjelp slik at Emilie får støtte og hjelp også av oss foreldre til å komme seg gjennom lidelsen. Jeg har foreslått Klinikk for spiseforstyrrelser på Lysaker , da den ga gode resultater for andre, men Gunnar durer i vei med sitt eget opplegg, som inntil nå ikke har gitt noe særlig fremgang for Emilie.'),
(269, '2017-05-01 16:14:00', '2017-05-03 06:37:50', 5, 'CONFLICT', '', 'Jeg fikk følgende sms fra andreas i dag:\r\n\r\nEmilie er helt gal oppe hos mamma nå. Mamma sier at hun ikke skal trene men så nekter og slår mamma \r\n\r\nJeg kjørte da rett opp dit. Alt vsr rolig da jeg kom frem. I ettertid sier emilie at hun ble sint fordi mamma spirte om hun hadde løpt opp til henne. Emilie synrs der er svært tungt å vanskelig at vi titt og ofte beskylder henne for ting hun ikke har gjort. Samt at vi ikke stoler på henne. Men slik er det dessverre blitt fordi hun lurer oss i ny og ne og det er vanskelig i finne ut av uten å spørre. Og da blir hun fort sint. Noe som også kan være en indikasjon på at hun har dårlig samviitighet.'),
(270, '2017-05-03 06:35:00', '2017-05-03 06:37:27', 5, 'INFO', 'VillaSult', 'Skal på informasjonsmøte på VillaSult.\r\nDet er en dropp in time mellom 0900 - 1100.'),
(271, '2017-05-03 04:00:00', '2017-05-04 06:33:44', 5, 'CONFLICT', 'Konflikt i forbindelse med Middag', 'Fikk saus til middagen og det ble problematisk å spise. Hun fikk da ekstra fresubin, dette da hun forklarte neg om problemet og klarte ikke å spise opp all maten. Det er bra at hun sier i fra når problemene dukker opp. Det bke ingen konflikt, men en rolig samtale rundt dette.'),
(272, '2017-05-04 06:38:00', '2017-05-04 06:41:25', 5, 'INFO', 'Emilies smoothi', '- bær 2 dl\r\n- 2 dl melk\r\n- 1 ss cottage cheese/youghurt\r\n- 1 ss goji bær \r\n- 0.5 dl soya bønner'),
(273, '2017-05-05 04:19:00', '2017-05-05 04:21:24', 5, 'INFO', 'Frokost', 'Emilie synes det er vanskelig å ikke jukse når hun spiser forkostblanding. Derfor er det ekstra viktig å følge med på akkurat da.'),
(274, '2017-05-05 04:22:00', '2017-05-05 04:27:47', 5, 'INFO', 'Dietplan', 'Vi har enes om at hun kan velge hvilke måltider hun skal spise frukt. Hun skal har frukt til 2 måltider. I praksis spiser hun kun frukt til kveldsmat og som mellommåltid. Men hun er flink og spiser mye frukt hver dag. Videre drikker hun ikke melk til lunsj på skolen av praktiske grunner, men tar alltid ett glass melk når hun kommer hjem fra skolen. Velger å la henne beholde dette ansvaret onntil videre eller at jeg avdekker juks.'),
(275, '2017-05-06 22:24:00', '2017-05-06 22:26:26', 5, 'INFO', 'Lørdags gotteri', 'Emilie har kost seg med lørdags gotteriet i kveld. Virker som om det har løsnet litt på den fronten.'),
(276, '2017-05-14 15:31:00', '2017-05-16 06:24:03', 5, 'INFO', 'Fastlege', 'Time hos berg legekontor 15.05.2017 kl 1300 for henvisning til villasult, pluss forespørsel om sonatisk oppfølging av emilie'),
(277, '2017-05-16 06:24:00', '2017-05-16 06:27:52', 5, 'INFO', 'Fastlege', 'Fastlegen tar nå sonatisk oppfølging av emilie. Fikk henvisning og sender søknad til villasult. Fastlege kan også henvise til rasp/capio hvis ønskelig. Jeg trodde det kun var bup som kunne gjøre det. Synd at jeg i så lang tid da har godtatt bup sin vegring mot å søke plass på rasp.\r\nVi avslutter samarbeidet med bup når avtale med villasult er på plass.'),
(278, '2017-05-17 04:00:00', '2017-05-17 20:20:37', 5, 'CONFLICT', 'Konflikt i forbindelse med Middag', 'Her ble det problemer fordi hun ville ikke at jeg skulle steke laksebrugeren i stekepanna, hun vill ha den stekt i ovnen.\r\nJeg stod på mitt og til slutt så spiste hun den, etter å ha varmet den opp igjen i ovnen. Det gikk relativt rolig for seg, selv om hun ble sint og frustrert fordi hun ikke fikk det som hun ville.'),
(279, '2017-05-20 09:45:00', '2017-05-20 09:47:33', 5, 'INFO', 'Nytt tøy', 'Emilie trenger nye bukser, undertøy, etc da mye er for lite. Gå gjennom tøyet hennes og fjern det som er for lite. Trange busker osv forsterker bare problemene hennes. '),
(280, '2017-05-20 10:59:00', '2017-05-20 23:00:45', 5, 'ACTIVITY', 'Løpetur', 'Vi løp en tur fra skar - øyungen - skar, 5 km på 25 minutter'),
(281, '2017-05-21 16:50:00', '2017-05-22 04:51:26', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka'),
(282, '2017-05-22 16:52:00', '2017-05-22 04:53:57', 5, 'INFO', 'Kaia', 'Emilie fortalte at kaia fra den gamle klassen hennes på bjølsen er innlagt på ullevål grunnet spiseforstyrrelse'),
(283, '2017-05-28 15:36:00', '2017-05-29 03:37:19', 5, 'ACTIVITY', 'Fotball', 'E og jeg spilte fotball på voldsløkka'),
(284, '2017-05-27 15:37:00', '2017-05-29 03:40:23', 5, 'ACTIVITY', 'Løpe trening', 'E fikk løpe intevaller på banen på idrettshøyskolen. 3x400m; 5x100m, 5x60m med pushups uten stopp.'),
(285, '2017-05-28 15:50:00', '2017-05-29 03:54:46', 5, 'INFO', 'Ekstra mat', 'Til kveldsmst spør hun spør om å få pise litt ekstra mat, dette særlig de dagene vi hsr hatt sktivitet.\r\nEn annen ting er st hun bruker telefonen rett før måltidene. Så her driver hun å sturer med ett eller annet. Jeg begynner derfor nå å ta mobilen fra henne før alle måtider.'),
(286, '2017-05-29 16:49:00', '2017-05-29 16:50:33', 6, 'INFO', 'Manglet fresubin', 'Emilie drakk ikke fresubin etter middag, da jeg ikke har mer igjen, hvilken type skal jeg kjøpe?..'),
(287, '2017-05-30 05:41:00', '2017-05-30 05:41:32', 5, 'INFO', 'Fresubin', 'Du kan gå på apoteket på ullevål sykehus.\r\nEmilie har e-resept, så det er bare å oppgi navn og fødselsnummer.\r\nHun skal ha Fresubin Energy Fibre'),
(288, '2017-05-31 08:14:00', '2017-05-31 20:15:03', 5, 'ACTIVITY', 'Løpetur', 'Emilie fikk lov til å løpe en runde rundt voldsløkka på egenhånd'),
(289, '2017-06-01 05:57:00', '2017-06-01 17:58:17', 6, 'INFO', 'Fresubin', 'Jeg har ikke kjøpt fresubin enda, så den har Emilie ikke fått etter middag i dag. '),
(290, '2017-06-03 05:57:00', '2017-06-03 06:02:00', 5, 'INFO', 'Veiing av mat', 'Emilie veier fortsatt maten når hun lager den selv. Tror ikke det gjelder alt, men kun noe. Det forteller meg at hun fortsatt teller kalorier og må ha kontroll over sitt daglige inntak.  Hun kjøper fortsatt lett produkter hvis jeg ikke følger med.\r\n\r\n'),
(291, '2017-06-03 06:07:00', '2017-06-03 06:08:48', 5, 'INFO', 'Syk', 'Emilie følte seg ikke helt bra i går og lå for det meste i sengen etter at hun kom hjem fra skolen. Hun hadde vondt i halsen og vsr litt varm, men ellers i fin form. '),
(292, '2017-06-09 09:43:00', '2017-06-09 21:46:13', 5, 'INFO', 'Fresubin', 'Gikk tom for fresubin og apoteket hadde heller ikke. Emilie har derfor fått redusert mengde fresubin på tors og fredag, tilsammen kun 300ml av totalt 1200ml.'),
(293, '2017-06-12 08:26:00', '2017-06-12 20:27:07', 6, 'INFO', 'Fresubin', 'Jeg har heller ikke fått tak i fresubin, slik at Emilie har manglet denne etter middag i dag.'),
(294, '2017-06-11 11:23:00', '2017-06-16 17:29:51', 5, 'INFO', 'Konfirmasjon', 'I dag ble emilie konfirmert i bakkehaugen kirke og vi feiret henne etterpå i b39. Både rønneberg og paulen.'),
(295, '2017-06-12 05:30:00', '2017-06-16 17:35:22', 5, 'REPORT', 'Oppsummering uke 24', 'Denne uken har e gått litt ned i vekt, dette mye grunnet at jeg har eksperimentert litt med fresubin mengden. Dette for å se utslaget på vekten og se om hun kompanserer med å spise mer. Så 300 g ned i vekt er nok mye grunnet dette og viser at vi fortsatt må følge dietplanen. '),
(296, '2017-06-17 07:19:00', '2017-06-18 07:22:32', 5, 'ACTIVITY', 'Trappeløp', 'Emilie fikk løpe 3 ganger opp trappene i unnarennet i holmenkollbakken. Det tok vel ca 30 min med litt oppvarming. Hun tok seg helt ut siste gangen. Tok til seg næring  etterpå, uoppfordret.'),
(297, '2017-06-17 07:22:00', '2017-06-18 07:25:48', 5, 'INFO', 'Måltider', 'Hun jukder forsatt ved måltidene. I dag helte hun ut fresubinen. Hun gjemmer pgså unna brødskiver. Hun styrer fælt med å telle kalorier. Vi må følge godt med pg hun skal ikke lage maten selv.\r\n'),
(298, '2017-06-18 07:25:00', '2017-06-18 07:31:25', 5, 'INFO', 'Villa Sult', 'Vi har nå vært to ganger i terapi hos villa sult pg jeg er dessverre ikke like sikker på at dette er rett sted. De har forsstt ikke kommet opp med en pøan slik som jeg har forespurt. Videre blir det ingen behandling i sommer. Noe jeg synes er useriøst. Vil sende dem en eppst vedrørende mine tanker. Men vet ikke vilket annet alternativ vi da har. Men vi har kun enkelttimer og da kan vi likegodt også gå til lysaker.'),
(299, '2017-06-16 07:43:00', '2017-06-18 19:46:24', 5, 'INFO', 'Villa Sult, møte', 'Under dagens møte fortalt sbp om sin mistanke om at e drev med egentrening når hun var hos henne. Mistanken har hun hatt i ca 6 måneder. Hun rådførte seg med madli på bup og det kom frem til at det kunne vøre bra for e å drive på med egentrening.\r\nJeg ble aldri informert om dette.'),
(300, '2017-06-19 05:00:00', '2017-06-19 17:01:08', 6, 'INFO', 'Fredubin', 'Jeg har fortsatt ikke fått kjøpt fresubin , så etter middag i dag ble denne ikke drukket.'),
(301, '2017-06-19 05:01:00', '2017-06-19 17:02:02', 6, 'INFO', 'Villa Sult', 'Jeg syntes vi bør gi Villa Sult en sjanse, dersom Emilie har troen på dette stedet.'),
(302, '2017-06-20 05:08:00', '2017-06-20 05:11:59', 5, 'INFO', 'Egen trenng', 'Emilie fortalt at hun noen ganger drev med egen trening når hun er hos mamma. Det er da sydommen som tvinger henne og hun sier at hun ikke liker det. Hun vil mye heller trene sammen med meg og at jeg har kontrollen. Det liker hun.\r\n'),
(303, '2017-06-20 05:12:00', '2017-06-20 05:14:15', 5, 'INFO', 'Veiing av mat', 'Emilie sier at hun har veid maten i lang tid men har satt seg som mål å slutte med det umiddelbart. Ha ba meg om å gjemme mat vekten.  Dette er fint hun klare å si i fra til meg.'),
(304, '2017-06-22 05:55:00', '2017-06-22 17:57:17', 6, 'INFO', 'Fresubin', 'Emilie drakk ikke fresubin etter middag, til tross for at jeg ga det til henne, og jeg regner med at Emilie fortsatt skal ha fresubin etter alle måltider!?'),
(305, '2017-06-24 06:29:00', '2017-06-24 06:34:46', 5, 'INFO', 'Villa Sult', 'Har nå avsluttet behandlingen hos villa sult da de ikke tilbyr noem oppfølging i sommer.\r\nOg det er ikke akseptabelt.\r\nTenker vi da prøver klinikken på lysaker, som jo ble anbefalt av foreldregruppen på rasp. Jeg skulle også ha hørt på dems skepsis hva villa sult angår. Ser jeg nå i ettertid. Men mye skyldes behandler på villa sult og dems motvilje mot å gi oss en plan over behandlingen.'),
(306, '2017-06-23 06:34:00', '2017-06-24 06:37:57', 5, 'INFO', 'Tusenfryd', 'Emilie og åste var sammen på tusenfryd. Emilie spise buritos som middag der. Er skeptisk til om hun da spiste bra, men hun påstår så. Veiimgem til tirsdag blir viktig, da hun har styrt mye selv denne uken. Og hun glemmer ofte fresubin.'),
(308, '2017-06-21 06:50:00', '2017-06-24 06:51:17', 5, 'INFO', 'Middag', 'E spiste middag hos marte. De lagde kjøttboller og pasta'),
(309, '2017-06-25 16:55:00', '2017-06-25 05:02:00', 5, 'INFO', 'Venner', 'I dsg var emilie dsmmen med åste mye av dagen de grillet på frysja. Jegvhentet henne hos aste kl 2330. Hun har nå styrt mange måltider selv i det siste. Litt gor mange kanskje, for jeg sliter litt med å stole på at hun spiser nok. Selv om hun påstår så.\r\nTror jeg gir henne for mye ansvar. Det for vi svar på ved veiing på tirsdag. Håper mine bekymringer ikke slår til. Men all erfaring tilsier at det er ikke særlig lurt å gi henne for frie tølyer. Hun teller forsatt kalorier og har god kontroll på inntaket og kanskje hun fortsatt trener på egenhånd i det skjulte.\r\nVi må følge nløye  med.'),
(310, '2017-06-25 05:02:00', '2017-06-25 05:05:12', 5, 'INFO', 'Terapi', 'Nå som hun ikke har noe tilbud om terapi, skal jeg ta en 30 min prat med henne jver tirsdsg etter veiing. Dette for å holde fokus og skal forståelsen av hbor viktige det er å gå opp i vekt, samt øke fett prosenten.\r\n'),
(311, '2017-06-25 10:16:00', '2017-06-25 22:19:48', 5, 'INFO', 'Egen trenng', 'E fortalte akkurat at hun driber med egentrening hver mandag når hun er hos mamma. Hun sier det er tvang og ønsker å slutte med det. Men at hun trenger hjelp til det. Jeg har foreslått at hun trener en dag i uken sammen med meg. Da har jeg full kontroll og håper at tvangen hennes da vil gi seg.'),
(312, '2017-06-25 10:21:00', '2017-06-25 22:23:04', 5, 'INFO', 'Middag', 'E og åste var på majorstua å spiste sushi.\r\nSms fra e:\r\nSpiste 15 biter makisushi, en nudelbolle og en vårrull'),
(314, '2017-06-28 05:47:00', '2017-06-28 05:50:16', 5, 'INFO', 'Ferie', 'I dag reiser e, a og sbp til antibes.\r\nDette er første gang sbp er ferie i franrike med den. De kommer hjem tirsdag 4 juli.'),
(315, '2017-06-30 07:20:00', '2017-06-30 07:21:51', 6, 'INFO', 'Fresubin', 'Emilie drakk ingen fresubin på avteisedag (28.06.17) og 1 fresubin i går (29.06.17).'),
(316, '2017-06-30 13:35:00', '2017-06-30 21:08:15', 6, 'INFO', 'Fresubin og lunsj i dag.', 'Vi har vært på Marineland i dag og Emilie og Andreas har vært mye rundt omkring i flere timer.\r\nEmilie har ikke drukket fresubin etter frokost og har nesten ikke drukket noe i løpet av dagen. Emilie har drukket 1 fresubin i dag ( etter kveldsmat).'),
(317, '2017-06-30 04:00:00', '2017-06-30 13:41:26', 6, 'CONFLICT', 'Konflikt i forbindelse med Lunsj', 'Emilie spiste bare litt av salaten og ville ikke ha drikke.'),
(318, '2017-06-30 05:37:00', '2017-06-30 17:41:48', 5, 'INFO', 'Måltider', 'Du må ikke la henne slippe unna fresubinen. Mas til hun tar den, hun må drikke 3 flasker pr dag. Jeg ringer henne i kveld. Høres ut som om hun nå sliter. Snakk rolig med henne. Og stå på ditt uansett. Hun pleier å bli sulten h is hun spiser lite til ett måltid oh spiser da mer senere. Samt at hun har sitt eget kaloriregnestykke som hun følger. Men det er vanskeligere for henne å regne ut da hun ikke følger de fast rutinene og maten i frankrike et anderledes.'),
(319, '2017-06-30 04:00:00', '2017-06-30 19:42:05', 6, 'CONFLICT', 'Konflikt i forbindelse med Lunsj', ''),
(320, '2017-06-30 08:04:00', '2017-06-30 20:06:28', 5, 'INFO', 'Frankrike, Antibes', 'Har snakket med emilie pg anmodet henne på det strekeste å drikke fresubinen, 3 flasker hver dag, samt spise til alle måltider.\r\nHun må følges opp på dette hele tiden,'),
(321, '2017-07-01 13:59:00', '2017-07-01 21:13:56', 6, 'INFO', 'Fresubin.', 'I dag har vi vært i Antibes gamleby og på stranden i Antibes. Emilie drikker fortsatt bare vann til måltidene og svært lite drikke utenom dette til tross for den høye varmen, og Emilie vil ikke ha fresubin i dag heller. Trente i dag etter strand-/ bytur. '),
(322, '2017-07-01 09:00:00', '2017-07-01 21:24:11', 5, 'INFO', 'Måltider', 'Bra du registrere allw avvik. Hun skal drikke fresubin, melk eller juice til måltidene og hun skal ikke trene. Du må  mase på henne, hun trenger hjelp. Og nå har hun kun deg, så ta ansvar og ikke bare la det passere. Jeg har sent hun sms og ringt henne, men hun tok ikke telefonen. Det er ikke bra at hun holder på slik. Da kan hun ikke være lenge sammen med deg. Jeg blir bekymret. '),
(323, '2017-07-03 06:52:00', '2017-07-03 06:55:50', 5, 'INFO', 'Fastlegen', 'Fastlegen ringte meg i dag og var bekymret for at emilie nå står uten tilbud om behandling. Vi datt opp time 23.8 for å diskutere veien videre. Hun mener vi bør søke plass på rasp. Noe jeg sa meg enig i.\r\nHar nå kontaktet spiseforstyrrelsesklinikken.no og spurt om hva de kan tilby av behandling.\r\n'),
(324, '2017-07-03 06:56:00', '2017-07-03 06:58:30', 5, 'INFO', 'Log av måltider.', 'Du er flink til å logge måltidene sbp. Men emilie må ta fresubin til hbert måltid. Hun skal ikke få bestemme om hun vil ta fresubin eller ei selv. Uteblir fresubinen er det stor sannsynlighet for at hun går ned i vekt. Og det mye.'),
(325, '2017-07-03 10:13:00', '2017-07-03 22:19:41', 5, 'INFO', 'Avbrudt ferie', 'Ferien avsluttes en dag før tiden grunnet emilies tilstand. Under hele oppholdet har hun nektet å drikke fresubin, ikke smør på brødskivene, samt trent jevnlig. Hun høre ikke på sbp og jeg er meget bekymret og ønsker at hun kommer hjem snarest mulig. Hun er nå ute av kontroll og sykdommen styrer henne. I ettertid ser jeg at det var dumt å la henne dra, hun sliter fælt når hun ikke lenger har de fast og kjente rammene rundt seg. All erfaring soer også det samme. Mitt ønske om å la hun få dra på ferie trumft dessverre min fornuft. Nå blir det en tøff jobb i etterkant for å få henne på rett kurs igjen.'),
(326, '2017-07-03 16:24:00', '2017-07-04 04:28:14', 5, 'INFO', 'Ferie', 'SBP ringer og forteller st emilie har slått seg vrang. Jeg snakker med Andreas og jan forteller at emilie slo han flere ganger i ryggen og var sint på han. Dette fordi han blandet seg inn i en diskusjon mellom hun og mamma. Det er vondt å høre Andreas fortelle dette. Jeg ber sbp om å avbryte ferien og komme hjem.'),
(327, '2017-07-03 16:28:00', '2017-07-04 04:38:36', 5, 'INFO', 'Ringer emilie', 'Jeg ringer å snakker med emilie. Hun er veldig lei seg å gråter. Hun roer seg ned etterhvert pg humøret vender sakte men sikkert tilbake. Hun forteller at hun blir veldig stressert grunnet at hun ikke har kontroll på hva maten inneholder når hun er i frankrike. Hun spiser derfor mye brød. \r\nMye grunnet dette føler hun også en sterk trang til å trene. Hun er veldig frustrert. Jeg fortelle mye om mat, trening og hvile. Samt fettprosenten hennes. Hun lurer også på hvordan hun skal vite om det er sykdommen eller henne selv som har lyst til å trene. Noe jeg ikke kan gi noe godt svar på. Hun begynner å snakke om middags menyen og gleder seg til å spise. Så sykdommen har sluppet taket for denne gang.'),
(328, '2017-07-05 09:28:00', '2017-07-05 09:42:26', 5, 'INFO', 'Ferie oppsummering', 'Emilie har vært 7 dager på ferie i antibes med andreas og sbp. Hun har gått ned 1.3 kg. Hun har ikke drukket fresubin eller melk til måltidene. Generelt tror jeg det har vært mye slurv. Det har også være konflikter, hvor e og a har slått hverandre. E har også slått sbp. E har også trent regelmessig.\r\nJeg hadde håpet på at emilie skulle takle dette på en bedre måte. Hadde regnet med en vektnedgang men ikke så stoe. Det at hun heller ikke tar fresubin og trener, viser bare at mamma ikke klarer å følge opp dette. Nå blir det en tøff oppgave i ettertid å få henne på rett kurs igjen. All ferie er utelukket inntil hun har gått opp minst 1.3 kg igjen. E skal være mest hos neg fortsatt.\r\nSå må vi ta uke for uke og se det an. '),
(329, '2017-07-05 11:01:00', '2017-07-05 11:09:32', 6, 'INFO', 'Fresubin og margarin/saus/dressing.', 'Vi reiste hjem fra Antibes i går ( 6 dager på reise) og Emilie har spist jevnt og trutt, men unngår fortsatt fresubin, margarin på brød, sauser/dressing til mat og dessert, dvs.at Emilie fortsatt spiser alt som er magert i tillegg til at hun ikke klarer å slappe av ordentlig før hun har vært i mye aktivitet i løper av dagen. Trist at jeg ikke klarte å få henne til å drikke/spise ordentlig på turen, men har lært at Emilie trenger svært faste rammer rundt måltider og aktivitetsmengde. '),
(330, '2017-07-09 07:39:00', '2017-07-09 07:39:35', 5, 'INFO', 'Emilie brev', 'Brev  fra Emilie 19.06.2017\r\n\r\nHva vi kan gjøre for å unngå:\r\n- Stress for deg på ferie med mamma\r\n- unngå vekttap\r\n- unngå bekymringer vedrørende sinktrening\r\n\r\nNoen ting vi kan gjøre for å inngå det som er nevnt over:\r\n- Vi kanmlager en lsite over trening jeg for lov til å gjøre i løpet av reisen for å unngå at jeg finner på endre ting. \r\nI tillegg bestemmer du hvor mye jeg ta i meg etterpå (f.eks 1 banan og 1 sjokomelk hvir jeg vil jogge rolig 5 km/30 min)\r\n- Jeg følger kostplanen på tur (dette er noe du ikke trenger å bekymre deg for hvis jeg har aktivitet pleier jeg også og spise mer, fordi jeg ikek vil ned i vekt.\r\nJeg vil vise at jeg klarer å være på ferie med mamma uten å få drastiskt vekttap). I tillegg føler jeg meg frisk nok til å dra på ferie.\r\n- Jeg skal si fra hvis jeg gjør noe jeg ikek får lov til, eller noe ut over reglene våre. I det siste har det blitt avslørt nye ting rundt meg, og nå som du vet alt er jeg ikke lenger\r\nredd for å si fra. Jeg ahr holdt på og sniktrent av og til ganske lenge, og har hatt skikkelig problemer med og si noe, så jeg ble egentlig litt glad når Andreas sa det til deg.\r\nMen inni meg må jeg forberede med mentalt før noen handling skjer. Jeg hadde nok ikke klart å bare plutselig spise godteri hvis jeg ikke hadde spist det på 1 år.\r\njeg må tenke  inni meg at: OK, lørdag om 3 uker skal jeg spise lørdagsgodt på ordentlig. Ikke bare snake på en bit. Sånn var det når jeg begynte med godtepose,\r\nog sånn var det med sniktreningen. Jeg hadde bestemt meg innvendign for å slutte når sommerferien starta, men du rakk i finne ut av det før. jeg har begynt å jobbe for å bli kvitt sykdommen veldig nå,\r\nfordi jeg har funnet ut at jeg ikek vil ha det sånn her lenger.\r\n\r\nNoe jeg har gjort er:\r\n- Sitte på do (siden jeg kom ut av sykehuset har jeg aldri sittet på dosetet, men nå er det ikke ett problem)\r\n- sitte å sykle\r\n- gå ett og ett trappetrinn, istendefor 2 og 2\r\n- veie maten\r\n- lage lister for alt jeg spiser\r\n\r\nAlle disse tvangstankene har jeg gjort tiltak for å bli kvitt, nettopp ved å gå mot dem. Og når sommeren er over, da er jeg frisk. det har jeg bestemt.'),
(331, '2017-07-12 09:14:00', '2017-07-13 21:15:46', 5, 'ACTIVITY', 'Sykkeltur', 'Emilie gikk ny sykkel då vi syklet en tur fra stvgt til hammern og tilbake til stvgt'),
(332, '2017-07-13 09:34:00', '2017-07-15 16:45:07', 5, 'INFO', 'Jølster', 'Har gitt emilie lov til å reise til jølster sammen med sbp og andreas i morgen. \r\nDette på trass av at jeg vet det vil resultere i vektnedgang og høyst sannsylig konflikter med både sbp og andreas. At e krangler med andreas er nytt og fordi a har begynt å blande seg inn. Det gjør han ikke når de er hos meg. Det er tungt å stå i mot når både sbp og emilie stresse og maser om ferie hele tiden. Begge tror faktisk at det er bra pg vil hjelpe mot sykdommen. Noe jeg er strekt uenig i og som all tidligere ergaring også har vist at er feil. Ei har sbp blitt flinkere til å følge opp, hun skyver lett ansvaret over på emilie. Så jeg jobber mue med emilie og gir henne sjansen til å vise st hun klare å følge dietplanen også når hun ikke er hos meg. Jeg trenger også pause og må få ladet batteriene. Emilie viser mange fine tendenser, men faller raskt tilbake til gamle synder hvis hun ikke følges nøye opp.\r\nJeg jobber med å få på plass nytt opplegg for terspi. Men i disse ferietider, tar det lang tid å få svar. Bi må 8kke glemme st emilie fortsatt er velfog syk og trenger masse jjelp og støtte for å bli kvitt sykdommen. Jeg tror nå faktisk st det kun er jeg som kan hjelpe henne ut av dette.  Og det skal jeg klare.\r\n\r\nJeg skal ring henne hver dag ca 2100 for å følge henne bedre opp enn da hun var i nice med sbp. Håper med dette å fange opp og få korriget avvik på ett tidlig tidspunkt.\r\nHvis e begynner å tulle med dietplanen på jølster skal hun sendes hjem.med en gang. Det er avtslen. Er isikker på om sbp vil gjøre det. Men har valgt å gi det en sjanse. Så for tiden vise hva utfallet blir. Tror emilie kan klare det. Og hvis ikke tar hun seg task inn når hun kommer hjem, satser jeg på.\r\n'),
(333, '2017-07-14 07:11:00', '2017-07-14 19:30:14', 5, 'INFO', 'Rasp familieterapi', 'Vi har nå avsluttet familieterapien på rasp. Den gikk over 5 ganger. Og jeg deltok på kun 2. Dette mye grunnet dårlig kjemi mellom sbp og meg, samt det var tungt å ta fri fra jobb igjen etter å ha vært borte i 8 mnd grunnet e sin sykdom. Andreas ble forespurt i forkant av hvert møte, men ville absolutt ikke være med. Og jeg syntes tvang ble helt feil i enn sånn setting.\r\n\r\nSbp var med e alle gangene. Jeg valgte også å utebli med håp om st e da ville engasjere seg litt mer. Når jeg var der lente hun seg vel mye på meg og vsr lite delaktig syntes jeg. Ei hadde jeg noe som helst utbytte av de øvelsene vi gjorde. Så for min del var hele opplegget av liten verdi. \r\nI ettertid har heller ikke emilie dsgt st hun har hatt noe merkbart utbyyte av familieterapien. Men hun var glad vi har prøvd og det er jeg også.\r\n\r\nJo mer jeg søker råd og får mer erfsring med sykdommen går detvopp for meg at jeg er den enste eksperten på emilies tilfelle. Men jeg trenger støtte og hjelp for å få henne frisk. Så jeg leter fortsatt etter hjelp. Men i disse ferietider er det lite response å få. Vil også høre med volvat.\r\nKlinikken på lysaker svarer ikke.\r\n\r\nHar time hos gastlegen 23.8 jbor vil skal doskutere veien videre og kanskje søke plass på rasp.\r\nSynd vi mistet all behandling grunnet villa sult son elendige håndtering av saken.');
INSERT INTO `event_log` (`id`, `created_date_time`, `last_modified_date_time`, `fk_user_id`, `level`, `title`, `content`) VALUES
(334, '2017-02-03 08:58:00', '2017-07-14 20:31:51', 5, 'INFO', 'Emilie brev', 'Jeg trener nesten aldri og hadde ganske mye energi nå. Jeg kunne spurt om jeg fikk trene med deg, men jeg turte ikke fordi du sa at du trente i går, og du skal på bandy i morgen.så jeg tenkte at du ikke orket. Dessuten har du sagt etter at jeg avslørte det med at jeg drakk vann at hvis du viste det hadde fu ikke latt meg bli med på de øktene\r\n Jeg skulle bare ta noen pushups, planken pg noen spenshopp, men jeg rakk ikke bli ferdig før du kom. Og jeg trente ikke mer. Jeg gikk langs akerselva. Det vsr ikke jeg som luktet vondt, det varcden hettegenseren jeg hadde på meg. Jeg hadde den jo på i dag tidlig og, og da syntes du også at jeg luktet vondt.\r\n\r\nJeg er lei for det. Også er det pgså litt på grunn av veiinga som var på onsdag. Det ble veldig vanskelig for meg og plutselig gå opp 0.5 kg når jeg nesten ikke har gått opp i vekt på over 3 mnd. Så denne uka har vært litt tøff for meg pg det sljønner kanskje du og med tanke på fresubin, lett produkter og nå denne treningsøkta. Jeg har også vært litt lei meg denne uka. Den har vært litt tøffere enn andre uker. Å tilbringe 3 dsger med deg og mamma sammen ble litt uvanlig for meg. Jeg følte at vi bare satt å diskuterte hele tiden. Og når du ble sur på meg på mandag. Og med dette med andreas på torsdag, hvor du ble sur på meg på fredagen og.\r\n\r\nDet har bare blitt for mye som har skjedd for meg denne uka. Og jeg tenkte kanskje å ta en liten treningsøkt i stua ville lette litt på humøret og hvordan heg hadde det inni meg. Jeg har nesten ikke vært i aktivitet denne uka heller, så jeg sprakk rett og slett. \r\nDet skal ikke skje. Men alt blir så mye enklere for meg hvis jeg for være i aktivitet. Vekten, msten, hvordan jeg føler meg. Og jeg bestemte meg egentlig ikke for å ta den økta før du hadde gått, for jegcspurte egentlig om du ville spille fotball med meg, men du svarte neg ikke helt på det. Så da tok jeg en liten økt for å forsikre meg om st jeg fikk være litt i aktivitet'),
(335, '2017-07-15 13:32:00', '2017-07-15 13:37:19', 6, 'INFO', 'Konflikter i familien.', 'GR og jeg har store problemer med å kommunisere saklig og dette vil forsinke prosessen med å få Emilie frisk raskest mulig. Behandlere til Emile har foreslått familieterapi, men  GR nekter å delta på et slikt scenario , til tross for at dette kan gi gode resultater for Emilie sin helse. '),
(336, '2017-07-15 08:17:00', '2017-07-15 20:19:11', 6, 'INFO', 'Emilie koser seg med lørdagsgodt i dag.', 'I dag har vi bare slappet av og kost oss i huset på Vestlandet.'),
(337, '2017-07-16 04:00:00', '2017-07-17 10:51:16', 6, 'CONFLICT', 'Konflikt i forbindelse med Kveldsmat', 'Emilie har spist vafler uten smør og syltetøy. '),
(338, '2017-07-17 07:48:00', '2017-07-17 19:49:50', 5, 'INFO', 'Konflikt', 'Du må beskrive konflikten bedre, hvordan skal man skjønne noe som helst ut av den ene setningen!'),
(339, '2017-07-17 07:49:00', '2017-07-17 19:50:57', 5, 'INFO', 'Jølster, Fresubin', 'Har emilie tatt fresubin til alle måltidene?'),
(340, '2017-07-18 11:32:00', '2017-07-18 11:35:36', 6, 'INFO', 'Fresubin', 'Vi har ikke mer fresubin igjen, og Emilie har drukket til alle måltider. Vi kjøper mer i Førde i dag, siden GR hadde utelatt å legge fresubin i kofferten til Emilie.'),
(341, '2017-07-18 11:35:00', '2017-07-18 11:39:05', 6, 'INFO', 'Konflikt ', 'Emilie spiste vafler på søndag til kveldsmat , men unngikk å ha på smør , noe som er gjenganger i problemstillingene rundt konflikter. '),
(342, '2017-07-18 14:16:00', '2017-07-18 14:17:10', 5, 'INFO', 'Fresibin', 'Emilie fikk med 12 flasker fresubin. Hva er dette for noe tull?'),
(343, '2017-07-18 08:55:00', '2017-07-18 20:56:59', 6, 'INFO', 'Konflikt med kveldsmat i dag.', 'Emilie ville ikke ha smør på brødskivene og kastet smørpakken i veggen, da jeg forklarte henne, at det er nødvendig.'),
(344, '2017-07-19 16:36:00', '2017-07-19 04:42:31', 5, 'INFO', '', 'Når emilie reagerer med sinne fordi du maser om at hun skal ha smør på brødskivene er det sykdommen som rår.\r\nOg det forteller megcst du følger opp og gjør ditt beste for at hun skal følgw kostplanen. Så du må bare stå på og ikke gi opp selv om emilie blir sint og lager konflikter. Det er nettopp slik som bringer henne videre og til slutt klarer hun å stå i mot sykdommen. Husk oppfølging av måltidene er det viktigste vi gjør. Husk også at du skal smøre på og skjære opp brødski ene. Emilie skal ikke gjøre det selv. Her må du også bli flinkere. Du skal ha kontrollen.'),
(345, '2017-07-22 06:28:00', '2017-07-23 09:30:36', 5, 'INFO', 'Jølster', 'E pg A kom hjem fra jølster på torsdag kveld. E ser sunn og bra ut, kan ikke se noen vesentlig vekt reduksjon, derfor venter jeg med veiing til titsdag. Så kommer vi inn i de faste rutinene igjen. Sikkert også godt for henne å få en ukes pause fra veiingen. \r\nHun og a har ikke hatt noen konflikter. Men andreas ble veldig sint pæ sbp og dyttet henne overende fordi hun ikke holdt avtalen om å dra hjem på torsdsg. Har snakket med andreas om dette og fortalt at drt er helt uakseptabel oppførsel. På forespørsel sier han at han har sagt unnskyld til mamma. \r\nHan er også frekk og banner pg ber meg holde kjeft, helt etter eget forgodt befinnende. Ha sier heller aldri innskyld eller viser tegn på at han skjønner at slik oppførsel er helt uakseptabel. Andreas er nå i puberteten, men det er ingen unnskylding.\r\nMå øke fokus rundt andreas og hans oppførsel, dette sklir nå helt ut.\r\nEtter sommeren skal han bo ihht samværsavtalen. Vurdere også ekstra tilltak for han.\r\n\r\nSbp nevner heller ikke slike episoder for meg, verken for e eller a. Og ved konfrontasjon, npr jeg får vite det lene etterpå av a eller e, er det ofte for sent til å reagere. Må derfor tenke forebyggende tiltak. Sbp er til ingen hjelp på det området heller.'),
(346, '2017-07-23 13:43:00', '2017-07-23 13:46:07', 5, 'INFO', 'Mat', 'E lurer fortsatt unna mat, glemmer fresubin, fjerner litt fra frokostblandingen. Hun setter det bare bort, så det er lett å finne. Dette viser bare at jeg må følge bedre med. Og det er jo en gjenganger. Emilie står på stedet hvil hva progresjon angår.'),
(347, '2017-07-23 10:27:00', '2017-07-23 22:32:08', 5, 'ACTIVITY', 'Tryvann', 'Emilie og Åste vsr i klatreparken på tryvann fra 1230 - 1800 i dag. E kjøpe calzone og sjonomelk der oppe til lunsj. Vaktene var imåonert over at e  gikk gjennom den vanskligste løypa uten å feile. Du surte pm hun drev med klatring og sa at nesten ingen klarte det. Pappa blir jo stolt når han hører slikt. '),
(348, '2017-07-24 10:21:00', '2017-07-24 22:24:18', 5, 'INFO', '', 'E og åste var ute å spiste sushi i ettermidag. E var hjemme kl 2200 og spiste også kveldsmat. Det er veiing i  morgen pg da er det ikke unormalt at hun spiser ekstra mye om kvelden.'),
(349, '2017-07-26 08:55:00', '2017-07-26 08:55:57', 5, 'INFO', 'Mat', 'Hun byttet ut rundstykken til kvelds i går med brødskiver uten smør'),
(350, '2017-07-27 06:00:00', '2017-07-27 18:02:55', 5, 'INFO', 'Syk', 'Emilie hadde feber å går k eld pg fikke 2 x halv paracett. I dagcer hun fri for ferber. Har tatt det rolig.'),
(351, '2017-07-28 14:36:00', '2017-07-28 14:37:56', 5, 'ACTIVITY', 'Trening', 'E løp 2 runder rundt sognsvann på egenhånd. Drakk en styrk og spiste en banan etterpå.'),
(353, '2017-07-28 04:00:00', '2017-07-29 11:09:00', 6, 'CONFLICT', 'Konflikt i forbindelse med Middag', 'Emilie drakk ikke fresubin etter middag og sa at hun vil drikke den hos GR. '),
(355, '2017-07-30 08:55:00', '2017-07-30 21:06:04', 5, 'INFO', 'Hellas, pliminiri', 'E fortalte at hun sliter med å spise grunnet at det bruker mye olje i maten her. Videre er det ikke melk her og juicen er som saft. Kveldsmaten må ve begynne å ta på rommer. Med andre prd, jeg må justere litt, da maten er problematisk. Noe som overrasker meg. E blir fort sur og sint før og under måltidene. Men hun drikke all fresubinen uten noe tull.\r\nEllers går det veldig greit. E og A leker fint sammen og de bader masse.  Godt å være masse sammen med andreas igjen. Han tuller masse og oppfører seg helt supert \r\nTror nok også at a synes det er fint å kjenne og forstå at jeg bryr meg masse om han også. Han trenger nærhet og masse omtanke fra meg. Han er en klok og flott gutt.'),
(356, '2017-07-31 14:53:00', '2017-07-31 14:53:42', 4, 'INFO', 'Test pepilie', 'Rrrrrrr'),
(357, '2017-07-31 16:17:00', '2017-08-03 04:19:47', 5, 'ACTIVITY', 'Trening', 'Fikk løpe på mølle, løp ontervall, hard og intens økt på ca 35 minutter'),
(358, '2017-08-05 09:25:00', '2017-08-05 21:54:22', 5, 'INFO', 'Rhodos, Plimmiri', 'E, A og jeg har vært en uke på Plimmiri. Det har  gått greit hva e pg dietplanen angår. Hun har drukket all fresubin alle dager. Hun har også forsynt seg med mat på egenhånd til alle måltidene. Jeg har fulgt opp og påpekt mangler. Tror nok hun har spist som normalt. Men det har vært mye aktivitet i form av bading. Så er usikker på bekten, men ser ikke for meg noen dramatisk nedgang. E har hatt hyppige humørsvingninger og har helt klart slitt med den greske maten til tider. Hun har opplyst om at bruken av olje har vært problematisk. Hun unngår også sauser og drikker kun vann hvis jeg ikke sier ifra. Melk hsr hun ikke drukket grunnet dårlig tilgang, så det jar gått i juice. Desert har som regel blitt frukt. Hun har styrt unna kakene. E og A har lekt litt sammen, men de har liten toleranse for hverandre og det blir fort litt sure miner.\r\nDet løser seg forøvrig raskt. A er ganske så lat og vanskelig å få med på ting. Han virker u8nteresert i det meste og hvos han blir med er innsatsen laber pg ikke helt fraværende. Når vi bader og leker i vannet er a til gjengjeld veldig aktiv. A må drars med på ting, hvis ikke sitter han gjerne inne å spiller hele tiden. Han har ingen grenser der. Vidrre skjønner han heller okke når nok er nok når det kommer til å tulle med både e og meg. Han gir seg ikke, uansett hvor mye jeg ber han om.å holde opp.\r\nMen a har vært snill og grei å ha med å gjøre pg oppført seg pent og bannet lite. Han har også vist interesse gor å vite mer om e sin sykdom og ønsker nok å bli mer involvert. Han synes det er vanskelig å forholde seg til e nå som hun er syk. Noe som fører til at de ikke leker så mye sammen mer. Jeg har snakket med a og forklart han en god del rundt e sin syldom.\r\n\r\nFerie er veldig utfordrende og slitsomt og jeg er fortsatt i den tro om at det heller ikke ganger e sin sykdom. Sykdommen følger oss uansett hvor vi er hen. E har også lurt unna mat og fresubin. \r\n\r\nA har også store utfordringer som jeg må ta tak i når skolen begynner. A sler hele tiden til sbp når jeg setter regler, dette fordi han sier reglene er lette å omgås når han er hos sbp. Derfor stikke han bare til sbp når jeg er streng. Detre skal det også bli slutt på.'),
(359, '2017-08-08 07:48:00', '2017-08-08 07:55:37', 5, 'INFO', 'Ferie', 'All ferie blir planlagt basert emilies progresjon. Derfor er det vanskelig å legge langsiktige planer. Ferie betyr i praksis vektnedgang. Og hun må derfor hjem å legge på seg igjen før nye ferie kan planlegges. Ferie ganger heller ikke sykdommen. Ferie er meget utfordrende og ekstra slitsomt for min del. Men veldig hyggelig de stundene e, a og jeg har det fint sammen. E har lagt rask på seg når hun kommet hjem og mentalt sett er nok ferie en abvelsling for henne. '),
(360, '2017-08-12 06:48:00', '2017-08-13 06:50:22', 5, 'ACTIVITY', 'Norefjell, Løpetur', 'Vi løpe opp slalombakken på norefjell. 1.7 lm. E brukte ca 17 mon. Hun drakk og spiste  bra rett etterpå. Og hun knuste meg.'),
(361, '2017-08-11 06:50:00', '2017-08-13 06:52:21', 5, 'ACTIVITY', 'Fotball', 'E, A og jeg spilte fotball i ballbingen på voldsløkka.'),
(362, '2017-08-09 06:52:00', '2017-08-13 06:54:44', 5, 'ACTIVITY', 'Fotball', 'E, A og jeg spilte fotball i ballbingen ved movann.'),
(363, '2017-08-12 06:55:00', '2017-08-13 07:00:19', 5, 'INFO', 'Norefjell', 'E og jeg dro til norefjell. Skal være her til tirsdag. A villie ikke være med, så han er hos mamma. Han ville heller leke med venner, og det kan jeg forstå. Han hadde heller ikke lyst til å gå i fjellet. Jeg lot han få bli hjemme, da jeg ikke ønsker å tvinge han til å bli med. Men vet jo at han alltid pleier å trives og kose seg når han er med. Han er jo alltid litt motvillig i starten, men ender også alltid opp med å vøre den mest aktive når vi gjør noe.'),
(364, '2017-08-14 07:01:00', '2017-08-14 07:09:38', 5, 'ACTIVITY', 'Norefjell, Høgvarde', 'I dag gikk vi til høgvarde. Turen tok ca 5 timer og var ca 21 km lang.  E tok til seg godt med næring etterpå. Drakk en ekstra flaske fresibin. Hin spiste stor biff burger til middag og til kveldsmat. '),
(365, '2017-08-14 08:32:00', '2017-08-15 20:33:19', 5, 'ACTIVITY', 'Sykleltur', 'Vi syklet rolig en tur på ca 16 km.'),
(366, '2017-08-15 08:33:00', '2017-08-15 20:35:28', 5, 'INFO', 'Fresubin', 'Oppdaget at e hadde gjemt unna fresubin.\r\nMen hun har spist godt. Men hun sliter med å ta til deg dette, selv når vi har hatt mye aktivitet.'),
(367, '2017-08-22 06:43:00', '2017-08-22 18:47:36', 6, 'INFO', 'Måltider', 'Emilie sliter fortsatte med å bruke smør/olje i matlagingen, og hun styrer alle måltidene selv, hun vil absolutt ikke ha noen form for innblanding og blir svært opprørt, dersom man kommenterer måltidene. Fresubinen er det også vanskelig å kontrollere siden hun enten ikke vil ha, eller tar fresubin litt nå og da. '),
(368, '2017-08-24 06:59:00', '2017-08-24 19:06:40', 6, 'INFO', 'Kostplan', 'Det er vanskelig å ha kontroll på det Emilie spiser , for hun vil gjøre alt selv og spiser ofte før Andreas og meg, og mens jeg lager middag til oss, men Emilie har spist bra, ofte mye til kvelds. Hun blir også fort frustrert , dersom ikke alt går etter hennes ønskeplan og man blir usikker på om det er spiseforstyrrelsen eller tenåringsproblemer, sannsynligvis litt av hver, men spiseforstyrrelsen styrer Emilie fortsatt mye.'),
(369, '2017-08-24 09:35:00', '2017-08-24 21:41:27', 5, 'INFO', 'Måltider', 'Jeg har sagt dette 100 vis av ganger. Du skal lage maten og kontrollere måltidene. Uansett hve emilie måtte mene og ønske.\r\nDu skal påse at hun drikker fresubinen. Nå må du snart forstå dette. Hun er syk og dette er absolutt ikke puberteten som styrer når det kommer til mat. Hun skal nå tilbake til meg slik at jeg får hunne på rett kurs igjen. Og slutt å gnål om ferie hele tiden, hun skal blir frisk. E lyer og lurer seg unna mat og dietplane etter eget forgodbefinnende.\r\n\r\n\r\nJeg orker fsen ikke gjenta meg selv flere gangen. '),
(370, '2017-08-26 06:48:00', '2017-08-27 16:33:45', 6, 'INFO', 'Oppussing hos gr', 'Emilie har vært  hos meg pga at GR har pusset opp , GR vet godt at dette ikke er Emilie eller min skyld og, at det er vanskelig å ta kontrollen over måltidene når hun er frustrert og sulten, da skal middagen gå fort å lage og dette vil hun absolutt gjøre selv, GR kan feks. snakke med Emilie om , at man også bør holde kostplanen og følge reglene for matlaging når Emilie er hos meg. '),
(371, '2017-09-02 07:18:00', '2017-09-02 07:27:23', 5, 'INFO', 'Progresjon', 'E har hatt en fin vektøkning ved siste måling. Hun har stort sett bodd hos sbp de sisite 14 dagene og styrt måltidene selv. Hun har slurvet med feresubin, dessert og med smør på brødskivene.Hun har ikke trent på egenhånd.  Dette er noe hun selv sier. Dette forteller neg at hun nå spiser stort sett bra og følger sulten. Og det rr bra.\r\nHvis hun nå fortsetter slik er tiden moden for å juster ned fresubin inntaket. Vi har snakket om det og vil se ting an til neste måling. Men glem ikke hun er fortsatt syk selv om vekten nå går den rette veien. Jeg ser også på henne st kroppen hennes begynner å få mer kvinnelige former. Så hun er på rett vei.\r\nVi skal til gastlegen onsdag 6.9 og må da legge en plan for videre behandling.\r\nVi må finne en psykolog som kan hjelpe henne på veien videre.'),
(372, '2017-09-03 09:55:00', '2017-09-04 09:57:05', 5, 'ACTIVITY', 'Sykeltur', 'E syklet seg en tur fra stvgt og til hammeren på egenhånd.'),
(373, '2017-09-05 15:54:00', '2017-09-05 15:58:09', 5, 'INFO', 'Dietplan', 'Grunnet bta progresjon har jeg besluttet å redusere fresubin fra 150 ml til 100 ml til hvert måltid. Dette grunnet emilie spiser mer mat helt uoppfordret. Hun er tydlig styrt av sulten. Derfor redusere jeg nå fresubin inntaket. Det har også vært mye slurv med fresubinen de siste 3 ukene, men hun har alikevel hatt fin vektøkning.'),
(374, '2017-09-06 16:51:00', '2017-09-07 04:42:07', 5, 'INFO', 'Fastlegen, legetime', 'Har vært hos fastlegen i dag, som var bortkasyet da fastlegen er syk og jeg snakket med en bikar. Har fått ny tim 17.10.2017 kl 0820. E skal da være med å ta blodprøve.\r\n\r\n\r\n'),
(375, '2017-09-07 16:37:00', '2017-09-07 04:40:30', 5, 'INFO', 'Mat', 'Emilie gjemt en brødskive fra frokosten i kjøkkenskuffen. Jeg oppdaget dette først ved kveldsmaten. Så hun har definitivt ikke sluttet med å lure meg på trass av at hun er blitt flinkere på mange områder.'),
(376, '2017-09-07 16:42:00', '2017-09-07 04:43:38', 5, 'INFO', 'Skole', 'E skal nå følge alle fag som normalt. Dette gjelder prøver og gym, som hun har hatt unntak fra tidligere. '),
(377, '2017-09-10 06:59:00', '2017-09-10 19:01:09', 5, 'ACTIVITY', 'Fotball', 'E, A og jeg har spilt fotball i maridalen.'),
(378, '2017-09-13 16:56:00', '2017-09-13 05:01:08', 5, 'INFO', 'Mat', 'E spiser nå generelt velldig bra til alle måltider. Noe som også viser på vekten. Hun har hatt en fin økning de siste 3 ukene.\r\nSlik det der ut nå vil jeg trappe ned ytterlig på fresubinen.  Jeg merker også at hun er i forandring og lurer faktisk på om puberteten han dtaryet opp igjen.\r\nKort fortalt, ting ser bra ut, men vi må fortsatt følge nøye med.'),
(379, '2017-09-17 05:37:00', '2017-09-17 05:39:59', 5, 'ACTIVITY', 'Løpetur', 'Emilie løp 2 runder rundt voldsløkka, pluss  6 økter i trappa. Hun er flink til å ta til seg næring etterpå, men jeg må selvfølgelig passe på at hun gjør det'),
(380, '2017-09-17 05:40:00', '2017-09-17 05:43:38', 5, 'INFO', 'Veier mat', 'Tok emilie i å veie maten hun lager. Jeg ble forbannet og kastet vekten. Dette er en påminnelse om at hun fortsatt har store problemer selv om hun nå snart har nådd normal vekt igjen. Jeg mistenker at fett prosenten hennes fortsatt er for lav. Og det skal jeg få sjekket. Må også finne en ny psykolog.'),
(381, '2017-09-17 05:43:00', '2017-09-17 05:51:29', 5, 'INFO', 'Venninner', 'Virker nå som om emilie har fått en god venn i spesielt åste. Hun har også mye kontakt med sunniva. Mari har også kommer inn i bildet og det må vi npk passe litt ekstra på tenker jeg. Dette da mari også har spiseforstyrrelse pg jeg er usikker på hvordan de påvirker hverandre. Det kan slå begge veier. Tenker at så lenge det ikke er bare mari og emilie er det greit.  Men det å være sammen med venner er veldig positivt og den beste terapien hun kan få. Det er min mening.\r\nMari, Sunniva og emilie var på nakkholem sammen. Mari har hytte der.'),
(382, '2017-09-18 14:31:00', '2017-09-19 02:35:59', 5, 'ACTIVITY', 'Koll friidrett', 'Emilie hadde sin første trenning med koll i dag. Hun likte det veldig godt og ønsker å fortsett. Her må jeg følge ekstremt godt med, og skal la henne få bli med. Men maks 2 ganger i uken. Er usikker på hvor lurt dette er, særlig med tanke på fett prosenten hennes.'),
(383, '2017-09-22 08:12:00', '2017-09-22 20:13:02', 5, 'ACTIVITY', 'Friidrett', 'E vsr på koll løpe trening'),
(384, '2017-09-23 06:10:00', '2017-09-23 06:12:38', 5, 'INFO', 'Koll friidrett', 'Emilie skal få lov til å melde seg inn i Koll friidrett. Hun skal få trene 2 ganger i uken.\r\nHun lkte seg veldig godt og har allrered blitt kjent med de andre jentene.\r\nJeg skal følge godt med, det er ett krav for at hun kan drive med løping.'),
(385, '2017-09-23 06:12:00', '2017-09-23 06:17:08', 5, 'INFO', 'Veiing', 'Emilie har yttret ønske om å ikke veie seg hver uke. Så hvis alt seg bra ut på tirsdag 26.09.2017, begynner vi å veie henne annen hver uke.\r\nHun er nå nesten normal bmi (50.4kg / 161.5 cm) og jeg ser ingen umiddlebar fare med dette.\r\nAlt med Emilie begynner nå å normailiserer seg, men jeg må finne en psykolog som kan få henne helt frisk.\r\nNå derier deg seg ikke om at hun ikke spiser nok, men hva hun spiser. Hun har fortsatt problemer på det området.'),
(386, '2017-09-25 06:26:00', '2017-09-29 05:05:22', 5, 'ACTIVITY', 'Koll trening', 'Løpetrening 1800 - 1930'),
(387, '2017-09-28 05:05:00', '2017-09-29 05:06:28', 5, 'ACTIVITY', 'Koll trening', 'Løpetrening 1700 - 1830, nih');
INSERT INTO `event_log_comment` (`id`, `created_date_time`, `last_modified_date_time`, `fk_user_id`, `fk_event_log_id`, `title`, `content`) VALUES
(1, '2017-05-06 19:27:28', '2017-05-06 19:27:28', 5, 274, NULL, 'skal bare teste det å legge til en kommentar'),
(2, '2017-05-06 20:10:00', '2017-05-06 20:10:00', 5, 271, NULL, 'her kan jeg legge til en kommentar'),
(3, '2017-05-06 20:10:31', '2017-05-06 20:10:31', 5, 271, NULL, 'nok en kommentar for å teste at det fungerer'),
(4, '2017-06-24 06:29:12', '2017-06-24 06:29:12', 5, 303, NULL, 'Test'),
(5, '2017-07-04 04:39:57', '2017-07-04 04:39:57', 5, 327, NULL, 'Sms fra emilie:\r\nNei vi ble nettopp ferdige med å spise, maten kom veldig sent. Men det går bra med meg nå pappa, jeg har roet meg ned. Ligger og er på telefonen nå. Har også gitt Andreas og mamma klem og sagt unnskyld til dem begge'),
(6, '2017-07-04 04:41:35', '2017-07-04 04:41:35', 5, 327, NULL, 'Ny sms fra emilie:\r\nJa skal det. Har hatt det superfint til nå, hvis vi ser bortifra noen småting:-)'),
(7, '2017-07-09 07:46:35', '2017-07-09 07:46:35', 5, 330, NULL, 'Emilie skrev dette til meg før hun dro på ferie med mamma.\r\nJeg leste det, men fikk ikke diskutert detet med henne før hun dro.\r\nNoe som var veldig dumt.\r\nHun spark vel på alle punktene og det kunen kanskje vært unngått hvis jeg hadde fulge henne opp bedre.\r\nMen det er nettopp det som er utfordringen, å følge henne opp til den minste detalj 24 timer i døgnet.\r\nJeg har blitt sløv og bruker nå mye lengre tid før jeg finenr ut av alle triksene hennes.\r\nEmilie sliter og jobber fælt for å bli kvitt sykedommen. det var veldig synd at Villa SUlt ikke kunne gi terapi timer i løpet av sommeren.\r\nMen jeg har nå forespurt Lysaker og vil også høre med Volvat.\r\nHun tenger treapi i løpet av sommeren, hun tror hun kan komme ut av detet på egenhånd. Men hun må ha hjelp.');
